(8, 0, NULL, NULL, 'Projet Espoir d\'Ariel', NULL, '<p>L&rsquo;objectif g&eacute;n&eacute;ral qui s&rsquo;inscrit dans le cadre global de la lutte contre le VIH/sida, est de <strong>&laquo;&nbsp;renforcer les capacit&eacute;s nationales pour am&eacute;liorer l&rsquo;acc&egrave;s et la disponibilit&eacute; des services de pr&eacute;vention, soins et traitement du VIH dans 10 districts de 5 r&eacute;gions sanitaires (Abidjan 1, Grand Ponts, San Pedro, Nawa, et Gbok&egrave;) &raquo;.</strong></p>\r\n<p>Sp&eacute;cifiquement, il s&rsquo;agit de&nbsp;:</p>\r\n<ol>\r\n<li>Assurer la continuit&eacute; des services complets de pr&eacute;vention, de soins, de traitement et de soutien du VIH/sida pour les clients des districts prioritaires pour l&rsquo;atteinte des objectifs 90 90 90.</li>\r\n<li>Renforcer la capacit&eacute; des structures nationales et des districts pour garantir des approches durables pour la fourniture de services VIH/sida complets et de qualit&eacute;.&nbsp;</li>\r\n</ol>\r\n<p>Ce projet, &eacute;labor&eacute; en tenant compte des principes de l&rsquo;initiative globale d&rsquo;appui &agrave; la sant&eacute; du Gouvernement am&eacute;ricain, a &eacute;t&eacute; con&ccedil;u dans la droite ligne d&rsquo;une contribution &agrave; la r&eacute;ponse nationale de lutte contre le VIH/Sida en C&ocirc;te d&rsquo;Ivoire.</p>\r\n<p>Comme le stipule l&rsquo;objectif g&eacute;n&eacute;ral, le principal int&eacute;r&ecirc;t du projet se situe dans le renforcement des capacit&eacute;s nationales dans le but de permettre aux populations b&eacute;n&eacute;ficiaires d&rsquo;avoir acc&egrave;s &agrave; des services de qualit&eacute; relativement &agrave; la pr&eacute;vention, aux soins et traitement du VIH/Sida.</p>\r\n<p>Pour ce faire, une des principales strat&eacute;gies d&rsquo;intervention retenue est &laquo;&nbsp;l&rsquo;approche district&nbsp;&raquo;. L&rsquo;approche district, facilite le soutien de la Fondation &agrave; travers une &eacute;troite collaboration avec les &eacute;quipes gestionnaires des districts dans la planification, la gestion, la supervision et l\'&eacute;valuation des programmes. Selon cette approche, chaque district est charg&eacute; d&rsquo;&eacute;laborer un plan d&rsquo;action int&eacute;gr&eacute; dans lequel on peut ais&eacute;ment retrouver un micro plan des activit&eacute;s VIH mettant l&rsquo;accent sur la pr&eacute;vention, les soins et le traitement du VIH dans le but de fournir des services de qualit&eacute; aux personnes vivant avec le VIH.</p>\r\n<p>Les &eacute;quipes, tant techniques que manag&eacute;riales, de la Fondation Ariel Glaser &eacute;tant constitu&eacute;es par des personnes qualifi&eacute;es, repr&eacute;sentent un atout pour la r&eacute;ussite du Projet Espoir d&rsquo;Ariel.</p>', NULL, NULL, NULL, 'actu3.png', NULL, NULL, 'projet-espoir-d-ariel', NULL, 1, 18, 1, '2019-09-18 15:18:23', '2019-09-18 00:00:00', '2019-09-18 00:00:00', 1, 0),
(9, 0, NULL, NULL, 'Projet Cœur d\'Ariel', NULL, '<p>L&rsquo;objectif g&eacute;n&eacute;ral de ce projet qui s&rsquo;inscrit dans le cadre global de la lutte contre le VIH/sida, &eacute;tait de <strong>&laquo;&nbsp;</strong>renforcer les capacit&eacute;s nationales pour am&eacute;liorer l&rsquo;acc&egrave;s et la disponibilit&eacute; des services de pr&eacute;vention, soins et traitement du VIH dans 29 districts de 7 r&eacute;gions sanitaires (Lagunes 1, Lagunes 2, Agneby, Moyen Como&eacute;, N&rsquo;Zi Como&eacute;, Bas Sassandra et Zanzan)&nbsp;&raquo;.</p>\r\n<p>A la faveur de la r&eacute;organisation de la couverture g&eacute;ographique des Partenaires de Mise en &OElig;uvre (PMO) au plan national op&eacute;r&eacute;e par le MSLS en collaboration avec CDC/PEPFAR, en Octobre 2013,&nbsp;la Fondation Ariel Glaser a couvert les r&eacute;gions suivantes: Abidjan 2, Abidjan 1 Grands Ponts et Gbokl&egrave; Nawa San Pedro.</p>\r\n<p><strong>R&eacute;alisations d\'Ariel 2011-2017</strong>: (Donn&eacute;es de routine d\'Ariel, juin 2017)</p>\r\n<p>&uuml;&nbsp; 673 271 femmes enceintes d&eacute;pist&eacute;es pour le VIH ont re&ccedil;u leurs r&eacute;sultats par le biais des services de PTME.</p>\r\n<p>&uuml;&nbsp; 43 291 PVVIH ont re&ccedil;u un traitement ARV (1/4 du nombre total des PVVIH sous ART en C&ocirc;te d\'Ivoire) dont 1 687 sont des enfants.</p>\r\n<p>&uuml;&nbsp; Taux de r&eacute;tention sur 12 mois: 86%.</p>\r\n<p><strong>Projet Sida Grant</strong>(projet de renforcement de l&rsquo;eTME dans le district sanitaire de Treichville-Marcory)</p>\r\n<p>Le projet sida Grant, financ&eacute; par l&rsquo;UNICEF a &eacute;t&eacute; mis en &oelig;uvre en 2013, dans le district sanitaire de Treichville-Marcory pour une p&eacute;riode de deux (2) ans. Il avait pour but de contribuer &agrave; l&rsquo;atteinte de l&rsquo;objectif de l&rsquo;&eacute;limination de la transmission du VIH/sida de la m&egrave;re &agrave; l&rsquo;enfant en C&ocirc;te d&rsquo;Ivoire &agrave; travers la mobilisation communautaire en vue de pr&eacute;parer le passage de la C&ocirc;te d&rsquo;Ivoire de l&rsquo;option B &agrave; l&rsquo;option B+ en PTME.</p>', NULL, NULL, NULL, 'actu2.png', NULL, NULL, 'projet-coeur-d-ariel', NULL, 1, 6, 1, '2019-09-18 15:18:23', '2019-09-18 00:00:00', '2019-09-18 00:00:00', 1, 0),
(10, 0, NULL, NULL, 'Projet UNITAIDS', NULL, '<p>Ce projet UNITAID en partenariat avec EGPAF avait pour objectif principal d&rsquo;am&eacute;liorer l&rsquo;acc&egrave;s des nourrissons aux tests diagnostiques pr&eacute;coces et innovants afin de renforcer la prise en charge effective des enfants infect&eacute;s. Ce projet s&rsquo;est d&eacute;roul&eacute; sur quatre (4) ans sur six (6) sites de la Fondation Ariel Glaser &agrave; Abidjan.</p>\r\n<p>Ce projet a permis l&rsquo;ouverture de 10 postes de d&eacute;pistage dont 3 HUBS (&agrave; l&rsquo;H&ocirc;pital G&eacute;n&eacute;ral de Marcory, CHU Treichville, FSU 220 Logements) et 7 SPOKE (CSU Com Aliodan, USAC, H&ocirc;pital G&eacute;n&eacute;ral de Treichville, FSU Locodjro, FSU Att&eacute;coub&eacute;, Maternit&eacute; Williamsville, CSU Com Williamsville). Gr&acirc;ce &agrave; ce projet, nous avons pu d&eacute;pister 100% des enfants qui avaient besoin de d&eacute;pistage avec un rendu de r&eacute;sultat imm&eacute;diat (le m&ecirc;me jour).</p>', NULL, NULL, NULL, 'actu1.png', NULL, NULL, 'projet-unitaids', NULL, 1, 19, 1, '2019-09-18 15:18:23', '2019-09-18 00:00:00', '2019-09-18 00:00:00', 1, 0),
