(30, 5, 27, NULL, 'Le RSPM CI sensibilise ses membres', NULL, '<p>Morbo will now introduce tonight\'s candidates&hellip; PUNY HUMAN NUMBER ONE, PUNY HUMAN NUMBER TWO, and Morbo\'s good friend, Richard Nixon. Yeah. Give a little credit to our public schools. You know, I was God once.</p>\r\n<ol>\r\n<li>And yet you haven\'t said what I told you to say! How can any of us trust you?</li>\r\n<li>Leela\'s gonna kill me.</li>\r\n<li>That\'s the ONLY thing about being a slave.</li>\r\n</ol>\r\n<h3>Oh, all right, I am. But if anything happens to me, tell them I died robbing some old man.</h3>\r\n<p>No, I\'m Santa Claus! These old Doomsday Devices are dangerously unstable. I\'ll rest easier not knowing where they are. Enough about your promiscuous mother, Hermes! We have bigger problems. Oh, you\'re a dollar naughtier than most.</p>\r\n<ul>\r\n<li>Quite possible. We live long and are celebrated poopers.</li>\r\n<li>I haven\'t felt much of anything since my guinea pig died.</li>\r\n<li>Look, everyone wants to be like Germany, but do we really have the pure strength of \'will\'?</li>\r\n</ul>\r\n<p>How much did you make me? Why did you bring us here? No! Don\'t jump! You know the worst thing about being a slave? They make you work, but they don\'t pay you or let you go. Is that a cooking show? The key to victory is discipline, and that means a well made bed. You will practice until you can make your bed in your sleep.</p>\r\n<p>In your time, yes, but nowadays shut up! Besides, these are adult stemcells, harvested from perfectly healthy adults whom I killed for their stemcells. I don\'t want to be rescued. Now Fry, it\'s been a few years since medical school, so remind me. Disemboweling in your species: fatal or non-fatal?</p>\r\n<p>I don\'t want to be rescued. You can see how I lived before I met you. Why would I want to know that? Fry! Stay back! He\'s too powerful! Also Zoidberg. Check it out, y\'all. Everyone who was invited is here.</p>\r\n<p>We\'re rescuing ya. These old Doomsday Devices are dangerously unstable. I\'ll rest easier not knowing where they are. Really?! I could if you hadn\'t turned on the light and shut off my stereo. I found what I need. And it\'s not friends, it\'s things.</p>\r\n<p>That\'s the ONLY thing about being a slave. I suppose I could part with \'one\' and still be feared&hellip; Wow, you got that off the Internet? In my day, the Internet was only used to download pornography.</p>\r\n<p>Perhaps, but perhaps your civilization is merely the sewer of an even greater society above you! Oh Leela! You\'re the only person I could turn to; you\'re the only person who ever loved me. Goodbye, cruel world. Goodbye, cruel lamp. Goodbye, cruel velvet drapes, lined with what would appear to be some sort of cruel muslin and the cute little pom-pom curtain pull cords. Cruel though they may be&hellip;</p>\r\n<p>Alright, let\'s mafia things up a bit. Joey, burn down the ship. Clamps, burn down the crew. You guys go on without me! I\'m going to go&hellip; look for more stuff to steal! I videotape every customer that comes in here, so that I may blackmail them later.</p>', NULL, NULL, NULL, '1.png', NULL, NULL, 'le-rspm-ci-sensibilise-ses-membres', NULL, 1, 3, 1, '2020-01-16 12:03:39', '2020-01-16 00:00:00', '2020-01-16 00:00:00', 1, 0),
(31, 5, 28, NULL, 'Le RSPM CI sensibilise ses membres', NULL, '<h3>Well I\'da done better, but it\'s plum hard pleading a case while awaiting trial for that there incompetence.</h3>\r\n<p>Fatal. I\'m just glad my fat, ugly mama isn\'t alive to see this day. Dear God, they\'ll be killed on our doorstep! And there\'s no trash pickup until January 3rd. A sexy mistake.</p>\r\n<ul>\r\n<li>What\'s with you kids? Every other day it\'s food, food, food. Alright, I\'ll get you some stupid food.</li>\r\n<li>Hey, whatcha watching?</li>\r\n<li>Hey, tell me something. You\'ve got all this money. How come you always dress like you\'re doing your laundry?</li>\r\n</ul>\r\n<p>And I\'m his friend Jesus. OK, this has gotta stop. I\'m going to remind Fry of his humanity the way only a woman can. I\'m sure those windmills will keep them cool. I just told you! You\'ve killed me! Shut up and take my money!</p>\r\n<p>It\'s just like the story of the grasshopper and the octopus. All year long, the grasshopper kept burying acorns for winter, while the octopus mooched off his girlfriend and watched TV. But then the winter came, and the grasshopper died, and the octopus ate all his acorns. Also he got a race car. Is any of this getting through to you? You\'re going back for the Countess, aren\'t you?</p>\r\n<p>We\'ll need to have a look inside you with this camera. Hey, whatcha watching? You guys aren\'t Santa! You\'re not even robots. How dare you lie in front of Jesus? I am the man with no name, Zapp Brannigan!</p>\r\n<p>Why am I sticky and naked? Did I miss something fun? No, I\'m Santa Claus! Bender, this is Fry\'s decision&hellip; and he made it wrong. So it\'s time for us to interfere in his life. Shut up and get to the point!</p>\r\n<p>Oh yeah, good luck with that. This is the worst kind of discrimination: the kind against me! Fry, we have a crate to deliver. Bender, we\'re trying our best. And I\'d do it again! And perhaps a third time! But that would be it.</p>\r\n<p>You\'ve killed me! Oh, you\'ve killed me! I never loved you. Your best is an idiot! Yeah, lots of people did. OK, this has gotta stop. I\'m going to remind Fry of his humanity the way only a woman can.</p>\r\n<p>Bite my shiny metal ass. Professor, make a woman out of me. I found what I need. And it\'s not friends, it\'s things. I daresay that Fry has discovered the smelliest object in the known universe! I guess if you want children beaten, you have to do it yourself.</p>\r\n<p>No, she\'ll probably make me do it. I never loved you. OK, if everyone\'s finished being stupid. Would you censor the Venus de Venus just because you can see her spewers? Who am I making this out to? How much did you make me?</p>\r\n<p>No, she\'ll probably make me do it. I am Singing Wind, Chief of the Martians. No argument here. Come, Comrade Bender! We must take to the streets!</p>\r\n<p>Wow! A superpowers drug you can just rub onto your skin? You\'d think it would be something you\'d have to freebase. Actually, that\'s still true. Or a guy who burns down a bar for the insurance money! For one beautiful night I knew what it was like to be a grandmother. Subjugated, yet honored.</p>\r\n<p>Hey, tell me something. You\'ve got all this money. How come you always dress like you\'re doing your laundry? Bite my shiny metal ass. Large bet on myself in round one. Bender, hurry! This fuel\'s expensive! Also, we\'re dying!</p>', NULL, NULL, NULL, '8.png', NULL, NULL, 'le-rspm-ci-sensibilise-ses-membres', NULL, 1, 15, 1, '2020-01-16 12:04:34', '2020-01-16 00:00:00', '2020-01-16 00:00:00', 1, 0),
