(34, 5, 29, NULL, 'Journée du SPM juin 2015 Allocution Reprent BAD', NULL, '<h2>Dear God, they\'ll be killed on our doorstep! And there\'s no trash pickup until January 3rd.</h2>\r\n<p>And so we say goodbye to our beloved pet, Nibbler, who\'s gone to a place where I, too, hope one day to go. The toilet. Dear God, they\'ll be killed on our doorstep! And there\'s no trash pickup until January 3rd.</p>\r\n<ol>\r\n<li>You mean while I\'m sleeping in it?</li>\r\n<li>With gusto.</li>\r\n<li>It\'s just like the story of the grasshopper and the octopus. All year long, the grasshopper kept burying acorns for winter, while the octopus mooched off his girlfriend and watched TV. But then the winter came, and the grasshopper died, and the octopus ate all his acorns. Also he got a race car. Is any of this getting through to you?</li>\r\n</ol>\r\n<h3>You, a bobsleder!? That I\'d like to see!</h3>\r\n<p>Five hours? Aw, man! Couldn\'t you just get me the death penalty? Now what? Ah, computer dating. It\'s like pimping, but you rarely have to use the phrase \"upside your head.\" I\'m a thing. I am Singing Wind, Chief of the Martians.</p>\r\n<ul>\r\n<li>You seem malnourished. Are you suffering from intestinal parasites?</li>\r\n<li>You, minion. Lift my arm. AFTER HIM!</li>\r\n<li>I had more, but you go ahead.</li>\r\n</ul>\r\n<p>I found what I need. And it\'s not friends, it\'s things. Meh. Negative, bossy meat creature! Bender, being God isn\'t easy. If you do too much, people get dependent on you, and if you do nothing, they lose hope. You have to use a light touch. Like a safecracker, or a pickpocket.</p>\r\n<p>So, how \'bout them Knicks? No argument here. Eeeee! Now say \"nuclear wessels\"! My fellow Earthicans, as I have explained in my book \'Earth in the Balance\'\', and the much more popular \'\'Harry Potter and the Balance of Earth\', we need to defend our planet against pollution. Also dark wizards.</p>\r\n<p>We\'ll go deliver this crate like professionals, and then we\'ll go home. Ah, the \'Breakfast Club\' soundtrack! I can\'t wait til I\'m old enough to feel ways about stuff! Guess again. Aww, it\'s true. I\'ve been hiding it for so long.</p>\r\n<p>The key to victory is discipline, and that means a well made bed. You will practice until you can make your bed in your sleep. For the last time, I don\'t like lilacs! Your \'first\' wife was the one who liked lilacs!</p>\r\n<p>Shut up and get to the point! Also Zoidberg. Also Zoidberg. It\'s a T. It goes \"tuh\". You, minion. Lift my arm. AFTER HIM!</p>\r\n<p>Daddy Bender, we\'re hungry. Moving along&hellip; No argument here. You can see how I lived before I met you.</p>\r\n<p>Tell her she looks thin. Hey, you add a one and two zeros to that or we walk! Good man. Nixon\'s pro-war and pro-family. We\'ll go deliver this crate like professionals, and then we\'ll go home.</p>\r\n<p>It may comfort you to know that Fry\'s death took only fifteen seconds, yet the pain was so intense, that it felt to him like fifteen years. And it goes without saying, it caused him to empty his bowels. No. We\'re on the top.</p>', NULL, NULL, NULL, '1.png', NULL, NULL, 'journee-du-spm-juin-2015-allocution-reprent-bad', NULL, 1, 21, 1, '2020-01-21 10:52:40', '2020-01-21 00:00:00', '2020-01-21 00:00:00', 1, 0),
(35, 5, 28, NULL, 'Journée du SPM juin 2015 Pprésentation DMP', NULL, '<div>\r\n<p>Face aux difficult&eacute;s r&eacute;currentes rencontr&eacute;es dans l&rsquo;acquisition de mat&eacute;riel informatique &agrave; savoir :</p>\r\n<ul>\r\n<li>(i) le nombre de plaintes re&ccedil;ues par les repr&eacute;sentants de marques de mat&eacute;riel informatique sur l&rsquo;authenticit&eacute; des documents transmis par de nombreux revendeurs dans les appels d&rsquo;offres,</li>\r\n<li>(ii) la fourniture par certains revendeurs d&rsquo;&eacute;quipements provenant de la contrefa&ccedil;on et</li>\r\n<li>(iii) la mauvaise connaissance du syst&egrave;me de SAV par les clients li&eacute;es souvent au manque de pr&eacute;cision et de transparence de certains revendeurs, le RSPM CI a organis&eacute;, en collaboration avec la soci&eacute;t&eacute; MC3, grossiste, repr&eacute;sentant de plusieurs marques informatiques, un &laquo; after work d&eacute;bat&raquo; le jeudi 11 f&eacute;vrier 2016 de 18H &agrave; 20H l&rsquo;h&ocirc;tel IBIS plateau sur le th&egrave;me &laquo;Comment am&eacute;liorer la qualit&eacute; dans le choix du mat&eacute;riel informatique.&raquo;</li>\r\n</ul>\r\n<p>Cette formation s&rsquo;est d&eacute;roul&eacute;e &agrave; l&rsquo;h&ocirc;tel Radisson Blu du 17 au 19 octobre 2016 et du 24 au 26 octobre 2016 du fait du nombre important de personnes &agrave; former a vu la participation, outre des Projets du portefeuille de la BM, de certains structures publiques (AGEROUTE, service en charge de la passation des march&eacute;s dans les Minist&egrave;res) et des structures impliqu&eacute;es dans les march&eacute;s publics (Direction des march&eacute;s publics : DMP, Autorit&eacute; Nationale de r&eacute;gularisation des march&eacute;s publics : ANRMP).</p>\r\n</div>', NULL, NULL, NULL, 'ab1.png', NULL, NULL, 'journee-du-spm-juin-2015-ppresentation-dmp', NULL, 1, 111, 1, '2020-01-21 10:54:27', '2020-01-21 00:00:00', '2020-01-21 00:00:00', 1, 0),
