(95, 24, NULL, NULL, 'Kouamé Jean Marc', NULL, '<p>I\'ll tell them you went down prying the wedding ring off his cold, dead finger. And yet you haven\'t said what I told you to say! How can any of us trust you? You can see how I lived before I met you. Dear God, they\'ll be killed on our doorstep! And there\'s no trash pickup until January 3rd.</p>\r\n<p>Oh no! The professor will hit me! But if Zoidberg \'fixes\' it&hellip; then perhaps gifts! Bender, quit destroying the universe! Yes, I saw. You were doing well, until everyone died. I could if you hadn\'t turned on the light and shut off my stereo.</p>', NULL, NULL, NULL, 't3.jpg', NULL, NULL, 'kouame-jean-marc', NULL, 1, NULL, 1, '2020-07-03 09:39:29', '2020-07-03 09:39:29', '2020-07-03 00:00:00', 1, 1),
(96, 25, 95, NULL, '1ere contribution et analyse', NULL, '<h1>Why would I want to know that?</h1>\r\n<p>Tell her she looks thin. Oh, all right, I am. But if anything happens to me, tell them I died robbing some old man. I can explain. It\'s very valuable. I was all of history\'s great robot actors - Acting Unit 0.8; Thespomat; David Duchovny!</p>\r\n<p>That could be \'my\' beautiful soul sitting naked on a couch.&nbsp;<strong>If I could just learn to play this stupid thing.</strong>&nbsp;<em>Yeah, lots of people did.</em>&nbsp;Morbo can\'t understand his teleprompter because he forgot how you say that letter that\'s shaped like a man wearing a hat.</p>\r\n<h2>I am the man with no name, Zapp Brannigan!</h2>\r\n<p>You mean while I\'m sleeping in it? Fry! Stay back! He\'s too powerful! Stop! Don\'t shoot fire stick in space canoe! Cause explosive decompression! Yeah. Give a little credit to our public schools.</p>\r\n<ol>\r\n<li>Whoa a real live robot; or is that some kind of cheesy New Year\'s costume?</li>\r\n<li>Anyhoo, your net-suits will allow you to experience Fry\'s worm infested bowels as if you were actually wriggling through them.</li>\r\n<li>Who\'s brave enough to fly into something we all keep calling a death sphere?</li>\r\n</ol>\r\n<h3>Maybe I love you so much I love you no matter who you are pretending to be.</h3>\r\n<p>But I\'ve never been to the moon! Leela, Bender, we\'re going grave robbing. Well I\'da done better, but it\'s plum hard pleading a case while awaiting trial for that there incompetence. As an interesting side note, as a head without a body, I envy the dead.</p>\r\n<ul>\r\n<li>You won\'t have time for sleeping, soldier, not with all the bed making you\'ll be doing.</li>\r\n<li>Oh yeah, good luck with that.</li>\r\n<li>And remember, don\'t do anything that affects anything, unless it turns out you were supposed to, in which case, for the love of God, don\'t not do it!</li>\r\n</ul>\r\n<p>I\'ll tell them you went down prying the wedding ring off his cold, dead finger. And yet you haven\'t said what I told you to say! How can any of us trust you? You can see how I lived before I met you. Dear God, they\'ll be killed on our doorstep! And there\'s no trash pickup until January 3rd.</p>\r\n<p>Oh no! The professor will hit me! But if Zoidberg \'fixes\' it&hellip; then perhaps gifts! Bender, quit destroying the universe! Yes, I saw. You were doing well, until everyone died. I could if you hadn\'t turned on the light and shut off my stereo.</p>\r\n<p>That could be \'my\' beautiful soul sitting naked on a couch. If I could just learn to play this stupid thing. Bender, hurry! This fuel\'s expensive! Also, we\'re dying! Tell her you just want to talk. It has nothing to do with mating.</p>\r\n<p>So, how \'bout them Knicks? We\'re rescuing ya. WINDMILLS DO NOT WORK THAT WAY! GOOD NIGHT! I never loved you. Ow, my spirit!</p>\r\n<p>I barely knew Philip, but as a clergyman I have no problem telling his most intimate friends all about him. Just once I\'d like to eat dinner with a celebrity who isn\'t bound and gagged. Oh yeah, good luck with that.</p>\r\n<p>I\'m sure those windmills will keep them cool. I was all of history\'s great robot actors - Acting Unit 0.8; Thespomat; David Duchovny! Okay, it\'s 500 dollars, you have no choice of carrier, the battery can\'t hold the charge and the reception isn\'t very&hellip;</p>\r\n<p>Good man. Nixon\'s pro-war and pro-family. Ow, my spirit! Meh. One hundred dollars. I love this planet! I\'ve got wealth, fame, and access to the depths of sleaze that those things bring.</p>\r\n<p>Bender, quit destroying the universe! Who\'s brave enough to fly into something we all keep calling a death sphere? Is that a cooking show? I\'m a thing. Yeah, and if you were the pope they\'d be all, \"Straighten your pope hat.\" And \"Put on your good vestments.\"</p>\r\n<p>Michelle, I don\'t regret this, but I both rue and lament it. When the lights go out, it\'s nobody\'s business what goes on between two consenting adults. Fetal stemcells, aren\'t those controversial? Large bet on myself in round one.</p>\r\n<p>Leela, are you alright? You got wanged on the head. OK, this has gotta stop. I\'m going to remind Fry of his humanity the way only a woman can. Guards! Bring me the forms I need to fill out to have her taken away!</p>\r\n<p>Fatal. Throw her in the brig. And I\'d do it again! And perhaps a third time! But that would be it. You\'re going back for the Countess, aren\'t you?</p>', NULL, NULL, NULL, 'restaurant-bar-instagram-marketing.png', NULL, NULL, '1ere-contribution-et-analyse', NULL, 1, 40, 1, '2020-07-03 09:40:42', '2020-07-03 09:40:42', '2020-07-03 00:00:00', 1, 1),
