(135, 5, NULL, NULL, 'LE RSPM CI Sensibilise les personnes en charge de la passation des marchés sur comment améliorer la qualité dans le choix du matériel informatique dans les appels à concurrence.', NULL, '<p>Face aux difficult&eacute;s r&eacute;currentes rencontr&eacute;es dans l&rsquo;acquisition de mat&eacute;riel informatique &agrave; savoir&nbsp;: (i) le nombre de plaintes re&ccedil;ues par les repr&eacute;sentants de marques de mat&eacute;riel informatique sur l&rsquo;authenticit&eacute; des documents transmis par de nombreux revendeurs dans les appels d&rsquo;offres, (ii) la fourniture par certains revendeurs d&rsquo;&eacute;quipements provenant &nbsp;de la contrefa&ccedil;on&nbsp;et (iii) la mauvaise connaissance du syst&egrave;me de SAV par les clients li&eacute;es souvent au manque de pr&eacute;cision et de transparence de certains revendeurs, le RSPM CI a organis&eacute;, en collaboration avec la soci&eacute;t&eacute; MC3, grossiste, repr&eacute;sentant de plusieurs marques informatiques, un &laquo;&nbsp;<strong>after work&nbsp;d&eacute;bat</strong>&raquo;&nbsp;<strong>le jeudi 11 f&eacute;vrier 2016 de 18H &agrave; 20H l&rsquo;h&ocirc;tel IBIS plateau</strong>&nbsp;sur le th&egrave;me &laquo;<strong>Comment am&eacute;liorer la qualit&eacute; dans le choix du mat&eacute;riel informatique</strong>.&raquo;</p>', NULL, NULL, NULL, '251920768.jpg', NULL, NULL, 'le-rspm-ci-sensibilise-les-personnes-en-charge-de-la-passation-des-marches-sur-comment-ameliorer-la-qualite-dans-le-choix-du-materiel-informatique-dans-les-appels-a-concurrence', NULL, 1, 2, 1, '2020-07-09 16:18:32', '2020-07-09 16:18:32', '2020-07-09 00:00:00', 1, 1),
(136, 5, NULL, NULL, 'La Banque mondiale forme les projets de son portefeuille en Côte d’Ivoire sur l’élaboration de la stratégie d’achat pour un projet de développement (PPSD)', NULL, '<p>Dans le but de promouvoir sa nouvelle politique en mati&egrave;re de passation des march&eacute;s publics, la Banque mondiale a organis&eacute; deux semaines de formation du personnel des projets de son portefeuille en C&ocirc;te d&rsquo;Ivoire sur&nbsp;<strong>l&rsquo;&eacute;laboration de la strat&eacute;gie d&rsquo;achat pour un projet de d&eacute;veloppement ou en anglais Project Procurement Strategy Development (PPSD)</strong>.<br />&nbsp;<br />Cette formation s&rsquo;est d&eacute;roul&eacute;e&nbsp;<strong>&agrave; l&rsquo;h&ocirc;tel Radisson Blu</strong>&nbsp;du&nbsp;<strong>17 au 19 octobre 2016 et du 24 au 26 octobre 2016</strong>&nbsp;du fait du nombre important de personnes &agrave; former a vu la participation, outre des Projets du portefeuille de la BM, de certains structures publiques (AGEROUTE, service en charge de la passation des march&eacute;s dans les Minist&egrave;res)&nbsp; et des structures impliqu&eacute;es dans les march&eacute;s publics (Direction des march&eacute;s publics&nbsp;: DMP, Autorit&eacute; Nationale de r&eacute;gularisation des march&eacute;s publics&nbsp;: ANRMP).</p>', NULL, NULL, NULL, '1.png', NULL, NULL, 'la-banque-mondiale-forme-les-projets-de-son-portefeuille-en-cote-d-ivoire-sur-l-elaboration-de-la-strategie-d-achat-pour-un-projet-de-developpement-ppsd', NULL, 1, 7, 1, '2020-07-09 16:19:14', '2020-07-09 16:19:14', '2020-07-09 00:00:00', 1, 1),
(137, 5, NULL, NULL, 'Le RSPM CI sensibilise ses membres sur La structuration des marchés fournisseurs et sa prise en compte dans la nouvelle approche de la BM en matière de marchés publics', NULL, '<p>La Banque mondiale s&rsquo;est dot&eacute;e d&rsquo;un nouveau Cadre de passation des march&eacute;s qui entre en vigueur le 1er&nbsp;juillet 2016. Con&ccedil;ue pour aider les pays &agrave; optimiser l&rsquo;emploi des d&eacute;penses publiques, cette refonte met en avant le r&ocirc;le strat&eacute;gique de la passation des march&eacute;s pour l&rsquo;efficacit&eacute; des interventions de d&eacute;veloppement. Le nouveau cadre permet de mener une analyse compl&egrave;te des facteurs qui influeront sur l&rsquo;adoption de la meilleure strat&eacute;gie de passation des march&eacute;s pour un&nbsp;projet d&eacute;termin&eacute;, &agrave; savoir notamment les capacit&eacute;s du pays, les organismes concern&eacute;s, les risques associ&eacute;s &agrave; la passation des commandes et surtout les conditions du march&eacute;,&nbsp;<strong>la connaissance du march&eacute; fournisseurs en fonction de son projet.</strong><br /><br />Pour faire face &agrave; ce nouveau d&eacute;fis, le R&eacute;seau des Sp&eacute;cialistes en Passation des March&eacute;s de C&ocirc;te d&rsquo;Ivoire&raquo; en abr&eacute;g&eacute; &laquo;&nbsp;RSPM-CI&nbsp;&raquo; organise un Diner d&eacute;bat sur le th&egrave;me &laquo;&nbsp;<strong>La structuration des march&eacute;s fournisseurs et sa prise en compte dans la nouvelle approche de la BM en mati&egrave;re de march&eacute;s publics</strong>&raquo; le&nbsp;<strong>vendredi 25 mars 2016 au Radisson Blue</strong>.</p>', NULL, NULL, NULL, 'ab1.png', NULL, NULL, 'le-rspm-ci-sensibilise-ses-membres-sur-la-structuration-des-marches-fournisseurs-et-sa-prise-en-compte-dans-la-nouvelle-approche-de-la-bm-en-matiere-de-marches-publics', NULL, 1, 1, 1, '2020-07-09 16:19:59', '2020-07-09 16:19:59', '2020-07-09 00:00:00', 1, 1),
