(155, 35, NULL, NULL, 'Tom Cruise : ses 10 plus grands exploits de tournage', NULL, '<p class=\"dm_article-chapeau\">Connu pour effectuer la grande majorit&eacute; de ses cascades lui-m&ecirc;me, Tom Cruise a r&eacute;alis&eacute;, en pr&egrave;s de 40 ans de carri&egrave;res, des dizaines de prouesses. Alors que le tournage de &laquo; Mission impossible 7 &raquo; a repris du service, donnant lieu &agrave; de nouveaux exploits de la part de l&rsquo;acteur de 58 ans, tour d&rsquo;horizon des plus grands d&eacute;fis que l&rsquo;acteur s&rsquo;est lanc&eacute;.</p>\r\n<p>Du premier Mission impossible, sorti en 1996 &agrave; aujourd&rsquo;hui, l\'acteur marche &agrave; l&rsquo;adr&eacute;naline, et plus les ann&eacute;es passent, plus il met la barre haut. Sur terre, dans les airs et m&ecirc;me sous l&rsquo;eau, rien ne semble pouvoir arr&ecirc;ter l&rsquo;Am&eacute;ricain.</p>\r\n<p>Si la sortie de &laquo; Mission impossible 7 &raquo;, toujours r&eacute;alis&eacute; par Christopher McQuarrie, a &eacute;t&eacute; repouss&eacute;e &agrave; novembre 2021, le tournage a repris et, avec lui, Tom Cruise endosse &agrave; nouveau sa combinaison de cascadeur. Sa derni&egrave;re prouesse en date, remonte &agrave; d&eacute;but septembre en Norv&egrave;ge et elle est une fois encore &agrave; couper le souffle. L&rsquo;acteur r&eacute;alise une nouvelle cascade motoris&eacute;e. Au guidon d&rsquo;une moto, il s&rsquo;&eacute;lance sur un tremplin et est propuls&eacute; dans les airs avec son engin, qui termine sa chute des dizaines de m&egrave;tres plus bas alors que Tom Cruise ouvre son parachute pour atterrir sans encombre.&nbsp;</p>', NULL, NULL, NULL, 'tom-cruise.jpg', NULL, NULL, 'tom-cruise-ses-10-plus-grands-exploits-de-tournage', NULL, 1, 1, 1, '2020-10-05 15:49:36', '2020-10-05 15:49:36', '2020-10-05 00:00:00', 1, 1),
