(169, 36, NULL, NULL, 'Le coup bas d’Angelina Jolie, irritée par Brad Pitt et Nicole Poturalski', NULL, '<p>De sources proches de l&rsquo;ancien couple mythique, l&rsquo;actrice de &laquo;&nbsp;Mal&eacute;fique&nbsp;&raquo; aurait eu du mal &agrave; encaisser le fait que son ex am&egrave;ne le mannequin Nicole Poturalski au ch&acirc;teau de Miraval au mois d&rsquo;ao&ucirc;t. C&rsquo;est que l&rsquo;acteur avait choisi la date de leur anniversaire de mariage pour faire visiter le Var &agrave; sa nouvelle&nbsp;<em>girlfriend</em>.</p>\r\n<p>Lire aussi &gt;&nbsp;<a href=\"https://parismatch.be/actualites/people/428905/brad-pitt-et-angelina-mettent-fin-au-dernier-lien-qui-les-nouait\">Brad Pitt et Angelina Jolie mettent fin au dernier lien qui les nouait</a></p>\r\n<p>Cons&eacute;quences ? Les tensions&nbsp;<em>&laquo;&nbsp;se sont intensifi&eacute;es</em>&nbsp;&raquo; entre eux, la th&eacute;rapie familiale s&rsquo;est arr&ecirc;t&eacute;e et le mannequin de 27 ans a m&ecirc;me fait allusion &agrave; la pol&eacute;mique sur Instagram. Aujourd&rsquo;hui, on apprend qu&rsquo;Angelia Jolie a eu l&rsquo;argument tout trouv&eacute; pour faire payer &agrave; Brad Pitt son manque de tact : une quarantaine forc&eacute;e de deux semaines.</p>\r\n<h2>Elle ne veut &laquo;&nbsp;rien entendre&nbsp;&raquo;</h2>\r\n<p><em>&laquo;&nbsp;Angelina a insist&eacute; pour que Brad reste confin&eacute; quatorze jours &agrave; son retour de France, avan&ccedil;ant une augmentation des cas de COVID-19 sur le territoire. Elle ne voulait pas prendre le risque que les enfants l&rsquo;attrapent</em>&laquo;&nbsp;,&nbsp;<a class=\"noFilter\" href=\"https://www.usmagazine.com/celebrity-news/news/angelina-jolie-insisted-brad-pitt-quarantine-after-france-trip/\" target=\"_blank\" rel=\"noopener\">lit-on dans&nbsp;<em>Us Weekly</em></a>. On le sait, la garde de Maddox, Pax, Zahara, Shiloh, les jumeaux Knox et Vivienne est le nerf de la guerre&nbsp; judiciaire qui les d&eacute;chire, et cette nouvelle aurait fait du mal &agrave; Brad Pitt qui a remu&eacute; ciel et terre pour changer la donne. L&rsquo;acteur de&nbsp;<em>Once Upon a Time&hellip; in Hollywood&nbsp;</em>a m&ecirc;me tent&eacute; de se faire tester &agrave; plusieurs reprises pour lui faire changer d&rsquo;avis&hellip; en vain. Angelina Jolie &laquo;&nbsp;<em>ne voulait rien entendre</em>&nbsp;&raquo; et Brad Pitt a donc d&ucirc; ronger son frein.</p>', NULL, NULL, NULL, 'belgaimage-125128065-full-1100x715.jpg', NULL, NULL, 'le-coup-bas-d-angelina-jolie-irritee-par-brad-pitt-et-nicole-poturalski', NULL, 1, 2, 1, '2020-10-05 16:08:13', '2020-10-05 16:08:13', '2020-10-05 00:00:00', 1, 1),
