(176, 37, NULL, NULL, 'Black mirror', NULL, '<p><em><strong><span class=\"lang-en\" lang=\"en\">Black Mirror</span></strong></em>&nbsp;(<span class=\"API nowrap\" title=\"Alphabet phon&eacute;tique international\">[<a class=\"mw-redirect\" title=\"API b\" href=\"https://fr.wikipedia.org/wiki/API_b\"><span title=\"[b] &laquo; b &raquo; dans &laquo; beau &raquo;.\">b</span></a><a class=\"mw-redirect\" title=\"API l\" href=\"https://fr.wikipedia.org/wiki/API_l\"><span title=\"[l] &laquo; l &raquo; dans &laquo; loup &raquo;.\">l</span></a><a class=\"mw-redirect\" title=\"API a\" href=\"https://fr.wikipedia.org/wiki/API_a\"><span title=\"[a] &laquo; a &raquo; dans &laquo; patte &raquo;.\">a</span></a><a class=\"mw-redirect\" title=\"API k\" href=\"https://fr.wikipedia.org/wiki/API_k\"><span title=\"[k] &laquo; c &raquo; dans &laquo; cabas &raquo;.\">k</span></a>&nbsp;<a class=\"mw-redirect\" title=\"API ˈ\" href=\"https://fr.wikipedia.org/wiki/API_%CB%88\"><span title=\"[ˈ] indique que la syllabe ou voyelle suivante porte l\'accent tonique.\">ˈ</span></a><a class=\"mw-redirect\" title=\"API m\" href=\"https://fr.wikipedia.org/wiki/API_m\"><span title=\"[m] &laquo; m &raquo; dans &laquo; mou &raquo;.\">m</span></a><a class=\"mw-redirect\" title=\"API ɪ\" href=\"https://fr.wikipedia.org/wiki/API_%C9%AA\">ɪ</a><a class=\"mw-redirect\" title=\"API ɹ\" href=\"https://fr.wikipedia.org/wiki/API_%C9%B9\"><span title=\"[ɹ] en anglais &laquo; r &raquo; dans &laquo; right &raquo;.\">ɹ</span></a><a class=\"mw-redirect\" title=\"API ə\" href=\"https://fr.wikipedia.org/wiki/API_%C9%99\"><span title=\"[ə] &laquo; e &raquo; dans &laquo; refrain &raquo;.\">ə</span></a>]</span><span id=\"cite_ref-1\" class=\"reference\"><a href=\"https://fr.wikipedia.org/wiki/Black_Mirror_(s%C3%A9rie_t%C3%A9l%C3%A9vis%C3%A9e)#cite_note-1\">1</a></span>&nbsp;<abbr class=\"abbr\" title=\"litt&eacute;ralement\">litt.</abbr>&nbsp;&laquo;&nbsp;Miroir noir&nbsp;&raquo; en&nbsp;<a title=\"Fran&ccedil;ais\" href=\"https://fr.wikipedia.org/wiki/Fran%C3%A7ais\">fran&ccedil;ais</a>) est une&nbsp;<a title=\"S&eacute;rie t&eacute;l&eacute;vis&eacute;e\" href=\"https://fr.wikipedia.org/wiki/S%C3%A9rie_t%C3%A9l%C3%A9vis%C3%A9e#Anthologie\">anthologie</a>&nbsp;<a title=\"S&eacute;rie t&eacute;l&eacute;vis&eacute;e\" href=\"https://fr.wikipedia.org/wiki/S%C3%A9rie_t%C3%A9l%C3%A9vis%C3%A9e\">t&eacute;l&eacute;vis&eacute;e</a>&nbsp;<a title=\"Royaume-Uni\" href=\"https://fr.wikipedia.org/wiki/Royaume-Uni\">britannique</a>, cr&eacute;&eacute;e par&nbsp;<a title=\"Charlie Brooker\" href=\"https://fr.wikipedia.org/wiki/Charlie_Brooker\">Charlie Brooker</a>. D\'abord diffus&eacute;e sur&nbsp;<span class=\"lang-en\" lang=\"en\"><a title=\"Channel 4\" href=\"https://fr.wikipedia.org/wiki/Channel_4\">Channel 4</a></span>&nbsp;de 2011 &agrave; 2014, elle a connu un succ&egrave;s international et est depuis 2016 (troisi&egrave;me saison) produite par&nbsp;<span class=\"lang-en\" lang=\"en\"><a title=\"Netflix\" href=\"https://fr.wikipedia.org/wiki/Netflix\">Netflix</a></span>.</p>\r\n<p>Les &eacute;pisodes sont li&eacute;s par le th&egrave;me commun de la mise en &oelig;uvre d\'une technologie&nbsp;<a title=\"Dystopie\" href=\"https://fr.wikipedia.org/wiki/Dystopie\">dystopique</a>. Le titre &laquo;&nbsp;<em><span class=\"lang-en\" lang=\"en\">Black Mirror</span></em>&nbsp;&raquo; fait r&eacute;f&eacute;rence aux &eacute;crans omnipr&eacute;sents qui nous renvoient notre reflet. Sous un angle&nbsp;<a title=\"Film noir\" href=\"https://fr.wikipedia.org/wiki/Film_noir\">noir</a>&nbsp;et souvent&nbsp;<a title=\"Satire\" href=\"https://fr.wikipedia.org/wiki/Satire\">satirique</a>, la s&eacute;rie envisage un futur proche, voire imm&eacute;diat. Elle interroge les cons&eacute;quences inattendues que pourraient avoir les&nbsp;<a title=\"Nouvelles technologies\" href=\"https://fr.wikipedia.org/wiki/Nouvelles_technologies\">nouvelles technologies</a>, et comment ces derni&egrave;res influent sur la&nbsp;<a title=\"Humanit&eacute;\" href=\"https://fr.wikipedia.org/wiki/Humanit%C3%A9\">nature humaine</a>&nbsp;de ses utilisateurs et inversement<span id=\"cite_ref-The_NYT_2-0\" class=\"reference\"><a href=\"https://fr.wikipedia.org/wiki/Black_Mirror_(s%C3%A9rie_t%C3%A9l%C3%A9vis%C3%A9e)#cite_note-The_NYT-2\">2</a></span>.</p>\r\n<p>La s&eacute;rie a re&ccedil;u un tr&egrave;s bon accueil critique. Elle a &eacute;t&eacute; salu&eacute;e pour l\'originalit&eacute; de sa repr&eacute;sentation de notre avenir.</p>', NULL, NULL, NULL, 'BlackMirrorTitleCard.jpg', NULL, NULL, 'black-mirror', NULL, 1, 1, 1, '2020-10-05 16:27:22', '2020-10-05 16:27:22', '2020-10-05 00:00:00', 1, 1),
