(242, 39, 196, NULL, 'Nous recherchons un comédien pour une pièce théâtrale', NULL, 'And why did \'I\' have to take a cab? Oh sure! Blame the wizards! Why, those are the Grunka-Lunkas! They work here in the Slurm factory. Oh, I don\'t have time for this. I have to go and buy a single piece of fruit with a coupon and then return it, making people wait behind me while I complain.\r\n\r\nNow that the, uh, garbage ball is in space, Doctor, perhaps you can help me with my sexual inhibitions? Why would I want to know that? Who are those horrible orange men? Have you ever tried just turning off the TV, sitting down with your children, and hitting them?\r\n\r\nBender, this is Fry\'s decision… and he made it wrong. So it\'s time for us to interfere in his life.\r\nWhen the lights go out, it\'s nobody\'s business what goes on between two consenting adults.\r\nYou guys aren\'t Santa! You\'re not even robots. How dare you lie in front of Jesus?\r\nYeah, and if you were the pope they\'d be all, \"Straighten your pope hat.\" And \"Put on your good vestments.\" The alien mothership is in orbit here. If we can hit that bullseye, the rest of the dominoes will fall like a house of cards. Checkmate.', NULL, NULL, NULL, NULL, NULL, NULL, 'nous-recherchons-un-comedien-pour-une-piece-theatrale', NULL, NULL, 26, 6, '2020-11-30 09:36:15', '2020-11-30 09:36:15', NULL, 1, 1),
(243, 39, 198, NULL, 'On recherche un homme grand de taille et albinos', NULL, '<p>Hey, whatcha watching? I just told you! You\'ve killed me! And when we woke up, we had these bodies. Yep, I remember. They came in last at the Olympics, then retired to promote alcoholic beverages! OK, if everyone\'s finished being stupid.</p><p>Bender?! You stole the atom. That\'s not soon enough! We\'re also Santa Claus! Pansy. No! The kind with looting and maybe starting a few fires!</p><p>We\'ll go deliver this crate like professionals, and then we\'ll go home. As an interesting side note, as a head without a body, I envy the dead. Why, those are the Grunka-Lunkas! They work here in the Slurm factory.</p><p>Who said that? SURE you can die! You want to die?! Fry! Quit doing the right thing, you jerk! Fry, we have a crate to deliver. Ooh, name it after me!</p><ol><li>Well, then good news! It\'s a suppository.</li><li>For example, if you killed your grandfather, you\'d cease to exist!</li><li>Why not indeed!</li></ol><p>Kif might! You can crush me but you can\'t crush my spirit! I saw you with those two \"ladies of the evening\" at Elzars. Explain that. Daddy Bender, we\'re hungry. OK, this has gotta stop. I\'m going to remind Fry of his humanity the way only a woman can.</p><p>Ah, the \'Breakfast Club\' soundtrack! I can\'t wait til I\'m old enough to feel ways about stuff! Bender, hurry! This fuel\'s expensive! Also, we\'re dying! Now Fry, it\'s been a few years since medical school, so remind me. Disemboweling in your species: fatal or non-fatal</p>', NULL, NULL, NULL, NULL, NULL, NULL, 'on-recherche-un-homme-grand-de-taille-et-albinos', NULL, NULL, 4, 6, '2020-12-04 10:29:37', '2020-12-04 10:29:37', NULL, 1, 1);
