(40, 2, 9, 8, 'introduction', 'La Fondation Ariel Glaser a bénéficié de septembre 2011 à avril 2018, de fonds du Gouvernement Américain pour la mise en œuvre sur 7 ans (2011-2018) d’un projet dénommé « Projet Cœur d’Ariel » (PCA).', NULL, 1, 1, '2020-01-27', '2020-01-27'),
(48, 7, 40, 9, 'poste', 'Vice-présidente, Conseil Exécutif', NULL, 1, 1, '2020-01-27', '2020-01-27'),
(41, 2, 8, 8, 'introduction', 'Le gouvernement américain à travers le PEPFAR appuie la Côte d’Ivoire dans la réponse nationale décentralisée et multisectorielle de lutte contre le VIH depuis 2004 à travers des ONG bénéficiaires de subventions. C’est dans ce cadre, qu’à la faveur de la phase 2 du PEPFAR axée sur le transfert progressif des compétences aux entités nationales, la Fondation Ariel Glaser bénéficie depuis septembre 2011, de fonds du Gouvernement Américain pour la mise en œuvre de projets. L’actuel projet de la Fondation est dénommé « Projet Espoir d’Ariel » (PEA).', NULL, 1, 1, '2020-01-27', '2020-01-27'),
(42, 4, 36, 6, 'libelle-du-bouton', '', NULL, 1, 1, '2020-01-27', '2020-01-27'),
