INSERT INTO `contenus` (`id`, `libelle_fr`, `intro_fr`, `description_fr`, `slug_fr`, `type_contenu`, `meta_title_fr`, `meta_desc_fr`, `image`, `ordre`, `nbr_vues`, `valid`, `statut`, `date_pub`, `date_enreg`) VALUES
(1, 'Ville de conakry', '', '<p>[code=syJ5v] [code=kP3nf]Le territoire o&ugrave; se trouve le Conakry d\'aujourd\'hui appartenait au&nbsp;<a title=\"Royaume de Dubr&eacute;ka\" href=\"https://fr.wikipedia.org/wiki/Royaume_de_Dubr%C3%A9ka\">royaume de Dubr&eacute;ka</a>. La r&eacute;gion est alors occup&eacute;e par les&nbsp;<a class=\"mw-redirect\" title=\"Bagas (peuple)\" href=\"https://fr.wikipedia.org/wiki/Bagas_(peuple)\">Bagas</a>, qui avaient accueilli des&nbsp;<a title=\"Soussou (peuple)\" href=\"https://fr.wikipedia.org/wiki/Soussou_(peuple)\">Soussous</a>, venus du Nord du Mandingue apr&egrave;s la destruction de leur capitale sur le&nbsp;<a title=\"Niger\" href=\"https://fr.wikipedia.org/wiki/Niger\">Niger</a>&nbsp;en 1236 par&nbsp;<a class=\"mw-redirect\" title=\"Soundjata Ke&iuml;ta\" href=\"https://fr.wikipedia.org/wiki/Soundjata_Ke%C3%AFta\">Soundjata Ke&iuml;ta</a>.</p>\r\n<div class=\"thumb tleft\">\r\n<div class=\"thumbinner\"><a class=\"image\" href=\"https://commons.wikimedia.org/wiki/File:Konakry-Vue_g%C3%A9n%C3%A9rale.jpg?uselang=fr\"><img class=\"thumbimage\" style=\"margin: 10px; float: left;\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/9/9b/Konakry-Vue_g%C3%A9n%C3%A9rale.jpg/220px-Konakry-Vue_g%C3%A9n%C3%A9rale.jpg\" alt=\"\" width=\"220\" height=\"165\" data-file-width=\"709\" data-file-height=\"533\" /></a>\r\n<div class=\"thumbcaption\">\r\n<div class=\"magnify\">&nbsp;</div>\r\nLa ville en 1912</div>\r\n</div>\r\n</div>\r\n<p>En 1887, l\'&icirc;le est enti&egrave;rement recouverte par une for&ecirc;t de palmiers et de fromagers, dans laquelle sont r&eacute;partis quatre villages&nbsp;: Conakry,<a class=\"new\" title=\"Boulbinet (page inexistante)\" href=\"https://fr.wikipedia.org/w/index.php?title=Boulbinet&amp;action=edit&amp;redlink=1\">Boulbinet</a>,&nbsp;<a class=\"new\" title=\"Krutown (page inexistante)\" href=\"https://fr.wikipedia.org/w/index.php?title=Krutown&amp;action=edit&amp;redlink=1\">Krutown</a>&nbsp;et&nbsp;<a class=\"new\" title=\"Tombo (page inexistante)\" href=\"https://fr.wikipedia.org/w/index.php?title=Tombo&amp;action=edit&amp;redlink=1\">Tombo</a>&nbsp;(c&eacute;d&eacute;e peu avant par les Anglais aux Fran&ccedil;ais). Sous la colonie fran&ccedil;aise, Conakry devient la capitale de la colonie des &laquo;&nbsp;<a class=\"new\" title=\"Rivi&egrave;res du Sud (page inexistante)\" href=\"https://fr.wikipedia.org/w/index.php?title=Rivi%C3%A8res_du_Sud&amp;action=edit&amp;redlink=1\">Rivi&egrave;res du Sud</a>&nbsp;&raquo; en 1889, puis de la colonie de&nbsp;<a title=\"Guin&eacute;e fran&ccedil;aise\" href=\"https://fr.wikipedia.org/wiki/Guin%C3%A9e_fran%C3%A7aise\">Guin&eacute;e fran&ccedil;aise</a>&nbsp;en 1891 (\"Guin&eacute;e Fran&ccedil;aise et D&eacute;pendances\", colonie autonome plac&eacute;e sous l&rsquo;autorit&eacute; du Gouvernement g&eacute;n&eacute;ral de Dakar).</p>\r\n<p>De 1966 &agrave; 1972, l\'ancien pr&eacute;sident ghan&eacute;en&nbsp;<a title=\"Kwame Nkrumah\" href=\"https://fr.wikipedia.org/wiki/Kwame_Nkrumah\">Kwame Nkrumah</a>&nbsp;y vit en exil et y fonde une maison d\'&eacute;dition &agrave; sa gloire.</p>\r\n<div class=\"thumb tright\">\r\n<div class=\"thumbinner\"><a class=\"image\" href=\"https://commons.wikimedia.org/wiki/File:Conakry-1970momunent.JPG?uselang=fr\"><img class=\"thumbimage\" style=\"float: left; margin: 10px;\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/b/b9/Conakry-1970momunent.JPG/220px-Conakry-1970momunent.JPG\" alt=\"\" width=\"220\" height=\"293\" data-file-width=\"1536\" data-file-height=\"2048\" /></a>\r\n<div class=\"thumbcaption\">\r\n<div class=\"magnify\">&nbsp;</div>\r\nMonument du 22 novembre 1970. On y lit des maximes de l\'&eacute;poque, comme &laquo;&nbsp;La r&eacute;volution est exigence&nbsp;&raquo; et &laquo;&nbsp;L\'imp&eacute;rialisme trouvera son tombeau en Guin&eacute;e&nbsp;&raquo;</div>\r\n</div>\r\n</div>\r\n<p>En 1970, une troupe compos&eacute;e de plusieurs centaines de soldats portugais et de volontaires guin&eacute;ens exil&eacute;s tente de prendre Conakry par les armes. L\'attaque est un &eacute;chec relatif&nbsp;: des soldats portugais pr&eacute;c&eacute;demment emprisonn&eacute;s sont lib&eacute;r&eacute;s du camp Ratoma et exfiltr&eacute;s, mais la tentative de renverser le r&eacute;gime dictatorial de&nbsp;<a title=\"Ahmed S&eacute;kou Tour&eacute;\" href=\"https://fr.wikipedia.org/wiki/Ahmed_S%C3%A9kou_Tour%C3%A9\">S&eacute;kou Tour&eacute;</a>&nbsp;&eacute;choue. Les pertes humaines sont importantes (on parle de centaines de morts guin&eacute;ens, sans compter les&nbsp;<span class=\"nowrap\">92 condamnations</span>&nbsp;&agrave; mort prononc&eacute;es lors d&rsquo;un proc&egrave;s par la suite), et donne le pr&eacute;texte &agrave; l\'instauration d\'un climat de terreur.</p>\r\n<p>En 1996, de violents affrontements entre militaires &eacute;branlent la capitale. Le pr&eacute;sident&nbsp;<a title=\"Lansana Cont&eacute;\" href=\"https://fr.wikipedia.org/wiki/Lansana_Cont%C3%A9\">Lansana Cont&eacute;</a>&nbsp;&eacute;chappe &agrave; la mort en se terrant dans les sous-sols du&nbsp;<a class=\"mw-redirect\" title=\"Palais des nations (Conakry)\" href=\"https://fr.wikipedia.org/wiki/Palais_des_nations_(Conakry)\">Palais des nations</a>.</p>\r\n<p>En 2007, une gr&egrave;ve g&eacute;n&eacute;rale et de violentes manifestations secouent Conakry et laissent plusieurs dizaines de morts sur le pav&eacute;.</p>\r\n<p>En 2009, une manifestation se transforme en bain de sang (plus d\'une centaine de morts, disparitions signal&eacute;es, nombreux viols) dans un affrontement avec les forces militaires.</p>\r\n<h2><span id=\"Organisation\" class=\"mw-headline\">Organisation</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a class=\"mw-editsection-visualeditor\" title=\"Modifier la section : Organisation\" href=\"https://fr.wikipedia.org/w/index.php?title=Conakry&amp;veaction=edit&amp;vesection=2\">modifier</a><span class=\"mw-editsection-divider\">&nbsp;|&nbsp;</span><a title=\"Modifier la section : Organisation\" href=\"https://fr.wikipedia.org/w/index.php?title=Conakry&amp;action=edit&amp;section=2\">modifier le code</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\r\n<p>Apr&egrave;s une tentative de d&eacute;centralisation en 1991, Conakry regroupe &agrave; partir de 2008 les cinq communes&nbsp;:&nbsp;<a title=\"Kaloum\" href=\"https://fr.wikipedia.org/wiki/Kaloum\">Kaloum</a>, le centre-ville&nbsp;;&nbsp;<a title=\"Dixinn\" href=\"https://fr.wikipedia.org/wiki/Dixinn\">Dixinn</a>, o&ugrave; se trouve l\'<a class=\"mw-redirect\" title=\"Universit&eacute; de Conakry\" href=\"https://fr.wikipedia.org/wiki/Universit%C3%A9_de_Conakry\">Universit&eacute; de Conakry</a>&nbsp;et de nombreuses ambassades&nbsp;;&nbsp;<a title=\"Ratoma\" href=\"https://fr.wikipedia.org/wiki/Ratoma\">Ratoma</a>, connue pour sa vie nocturne&nbsp;;&nbsp;<a title=\"Matam (Guin&eacute;e)\" href=\"https://fr.wikipedia.org/wiki/Matam_(Guin%C3%A9e)\">Matam</a>&nbsp;;&nbsp;<a title=\"Matoto\" href=\"https://fr.wikipedia.org/wiki/Matoto\">Matoto</a>, qui h&eacute;berge l\'a&eacute;roport. Les cinq communes forment la&nbsp;<a title=\"R&eacute;gion de Conakry\" href=\"https://fr.wikipedia.org/wiki/R%C3%A9gion_de_Conakry\">r&eacute;gion de Conakry</a>, l\'une des huit r&eacute;gions de Guin&eacute;e, et elle est dirig&eacute;e par un gouverneur. La ville est jumel&eacute;e avec&nbsp;<a title=\"Cleveland\" href=\"https://fr.wikipedia.org/wiki/Cleveland\">Cleveland</a>&nbsp;aux&nbsp;<a title=\"&Eacute;tats-Unis\" href=\"https://fr.wikipedia.org/wiki/%C3%89tats-Unis\">&Eacute;tats-Unis</a>.</p>', 'ville-de-conakry', 0, '', '', '', 6, 4, 0, 1, '2016-10-02', '2016-10-02'),
(2, 'Contenu 2', '', '<p>[code=kP3nf]</p>\r\n<h2><span id=\"G.C3.A9ographie\" class=\"mw-headline\">G&eacute;ographie</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a class=\"mw-editsection-visualeditor\" title=\"Modifier la section : G&eacute;ographie\" href=\"https://fr.wikipedia.org/w/index.php?title=Guin%C3%A9e&amp;veaction=edit&amp;vesection=1\">modifier</a><span class=\"mw-editsection-divider\">&nbsp;|&nbsp;</span><a title=\"Modifier la section : G&eacute;ographie\" href=\"https://fr.wikipedia.org/w/index.php?title=Guin%C3%A9e&amp;action=edit&amp;section=1\">modifier le code</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\r\n<div class=\"thumb tleft\">\r\n<div class=\"thumbinner\"><a class=\"image\" href=\"https://commons.wikimedia.org/wiki/File:Guinee_carte.png?uselang=fr\"><img class=\"thumbimage\" style=\"float: left; margin: 10px;\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/b/b9/Guinee_carte.png/220px-Guinee_carte.png\" alt=\"\" width=\"220\" height=\"237\" data-file-width=\"330\" data-file-height=\"355\" /></a>\r\n<div class=\"thumbcaption\">\r\n<div class=\"magnify\">&nbsp;</div>\r\nCarte de Guin&eacute;e</div>\r\n</div>\r\n</div>\r\n<div class=\"bandeau-section bandeau-niveau-detail loupe\">Article d&eacute;taill&eacute;&nbsp;:&nbsp;<a title=\"G&eacute;ographie de la Guin&eacute;e\" href=\"https://fr.wikipedia.org/wiki/G%C3%A9ographie_de_la_Guin%C3%A9e\">G&eacute;ographie de la Guin&eacute;e</a>.</div>\r\n<p>La Guin&eacute;e se trouve sur la c&ocirc;te atlantique de l&rsquo;Afrique de l\'Ouest.</p>\r\n<p>Elle est entour&eacute;e de la&nbsp;<a title=\"Guin&eacute;e-Bissau\" href=\"https://fr.wikipedia.org/wiki/Guin%C3%A9e-Bissau\">Guin&eacute;e-Bissau</a>&nbsp;(<span class=\"nowrap\">385&nbsp;km</span>&nbsp;de fronti&egrave;res), du&nbsp;<a title=\"S&eacute;n&eacute;gal\" href=\"https://fr.wikipedia.org/wiki/S%C3%A9n%C3%A9gal\">S&eacute;n&eacute;gal</a>&nbsp;(<span class=\"nowrap\">330&nbsp;km</span>), du<a title=\"Mali\" href=\"https://fr.wikipedia.org/wiki/Mali\">Mali</a>&nbsp;(<span class=\"nowrap\">858&nbsp;km</span>), de la&nbsp;<a title=\"C&ocirc;te d\'Ivoire\" href=\"https://fr.wikipedia.org/wiki/C%C3%B4te_d%27Ivoire\">C&ocirc;te d\'Ivoire</a>&nbsp;(<span class=\"nowrap\">610&nbsp;km</span>), du&nbsp;<a title=\"Liberia\" href=\"https://fr.wikipedia.org/wiki/Liberia\">Liberia</a>&nbsp;(<span class=\"nowrap\">563&nbsp;km</span>), de la&nbsp;<a title=\"Sierra Leone\" href=\"https://fr.wikipedia.org/wiki/Sierra_Leone\">Sierra Leone</a>(<span class=\"nowrap\">652&nbsp;km</span>) et de l\'<a title=\"Oc&eacute;an Atlantique\" href=\"https://fr.wikipedia.org/wiki/Oc%C3%A9an_Atlantique\">oc&eacute;an Atlantique</a>.</p>\r\n<p>On distingue quatre zones g&eacute;ographiques&nbsp;:</p>\r\n<ul>\r\n<li>une zone c&ocirc;ti&egrave;re, la Basse-Guin&eacute;e ,&nbsp;<a title=\"Guin&eacute;e maritime\" href=\"https://fr.wikipedia.org/wiki/Guin%C3%A9e_maritime\">Guin&eacute;e maritime</a>&nbsp;ou le Kakand&eacute;</li>\r\n<li>une zone montagneuse, la&nbsp;<a title=\"Moyenne-Guin&eacute;e\" href=\"https://fr.wikipedia.org/wiki/Moyenne-Guin%C3%A9e\">Moyenne-Guin&eacute;e</a>, qui comprend le massif du&nbsp;<a class=\"mw-redirect\" title=\"Fouta Djallon\" href=\"https://fr.wikipedia.org/wiki/Fouta_Djallon\">Fouta Djalon</a>,</li>\r\n<li>une zone de savane au nord, la&nbsp;<a title=\"Haute-Guin&eacute;e\" href=\"https://fr.wikipedia.org/wiki/Haute-Guin%C3%A9e\">Haute-Guin&eacute;e</a>,</li>\r\n<li>une zone de for&ecirc;ts au sud-est, la&nbsp;<a title=\"Guin&eacute;e foresti&egrave;re\" href=\"https://fr.wikipedia.org/wiki/Guin%C3%A9e_foresti%C3%A8re\">Guin&eacute;e foresti&egrave;re</a>.</li>\r\n</ul>\r\n<p>Ces quatre zones, parfois appel&eacute;es &laquo;&nbsp;r&eacute;gions naturelles&nbsp;&raquo;, ne correspondent pas aux r&eacute;gions administratives.</p>\r\n<h3><span id=\"Hydrographie\" class=\"mw-headline\">Hydrographie</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a class=\"mw-editsection-visualeditor\" title=\"Modifier la section : Hydrographie\" href=\"https://fr.wikipedia.org/w/index.php?title=Guin%C3%A9e&amp;veaction=edit&amp;vesection=2\">modifier</a><span class=\"mw-editsection-divider\">&nbsp;|&nbsp;</span><a title=\"Modifier la section : Hydrographie\" href=\"https://fr.wikipedia.org/w/index.php?title=Guin%C3%A9e&amp;action=edit&amp;section=2\">modifier le code</a><span class=\"mw-editsection-bracket\">]</span></span></h3>\r\n<p>Le pays compte plus de 1300 cours d\'eau. De nombreux fleuves, tels le&nbsp;<a title=\"Niger (fleuve)\" href=\"https://fr.wikipedia.org/wiki/Niger_(fleuve)\">Niger</a>, le&nbsp;<a title=\"S&eacute;n&eacute;gal (fleuve)\" href=\"https://fr.wikipedia.org/wiki/S%C3%A9n%C3%A9gal_(fleuve)\">S&eacute;n&eacute;gal</a>&nbsp;(Bafing), la&nbsp;<a title=\"Gambie (fleuve)\" href=\"https://fr.wikipedia.org/wiki/Gambie_(fleuve)\">Gambie</a>, ainsi que leurs principaux affluents trouvent leur source en Guin&eacute;e, faisant de ce pays le &laquo;&nbsp;ch&acirc;teau d\'eau&nbsp;&raquo; de l&rsquo;Afrique de l&rsquo;Ouest. Ces cours d\'eau partent des massifs guin&eacute;ens (les deux vieux massifs du Fouta Djalon et la dorsale guin&eacute;enne en r&eacute;gion foresti&egrave;re). La Gambie et le Bafing vont vers le S&eacute;n&eacute;gal au Nord. La source du Niger est &agrave; proximit&eacute; de Kobikoro, il traverse Faranah, Kouroussa et va vers le Mali au Nord-Est. Les fleuves&nbsp;<a title=\"Tinkisso\" href=\"https://fr.wikipedia.org/wiki/Tinkisso\">Tinkisso</a>,&nbsp;<a title=\"Milo (rivi&egrave;re)\" href=\"https://fr.wikipedia.org/wiki/Milo_(rivi%C3%A8re)\">Milo</a>,&nbsp;<a title=\"Niandan\" href=\"https://fr.wikipedia.org/wiki/Niandan\">Niandan</a>&nbsp;sont ses affluents en Guin&eacute;e.</p>\r\n<p>De nombreux fleuves c&ocirc;tiers descendent des massifs guin&eacute;ens vers l&rsquo;ouest, comme le&nbsp;<a title=\"Konkour&eacute; (fleuve)\" href=\"https://fr.wikipedia.org/wiki/Konkour%C3%A9_(fleuve)\">Konkour&eacute;</a>, ou vers le sud, comme le fleuve&nbsp;<a title=\"Mano (fleuve)\" href=\"https://fr.wikipedia.org/wiki/Mano_(fleuve)\">Mano</a>.</p>\r\n<p>De la Guin&eacute;e-Bissau &agrave; Conakry, ces fleuves forment de profonds estuaires qui ont conserv&eacute; les noms donn&eacute;s par les explorateurs&nbsp;<a title=\"Portugal\" href=\"https://fr.wikipedia.org/wiki/Portugal\">portugais</a>&nbsp;au&nbsp;<a title=\"XVe si&egrave;cle\" href=\"https://fr.wikipedia.org/wiki/XVe_si%C3%A8cle\"><abbr class=\"abbr\" title=\"15? si&egrave;cle\"><span class=\"romain\">xv</span><sup>e</sup></abbr>&nbsp;si&egrave;cle</a>. Ces estuaires constituent des voies de communications &agrave; travers la&nbsp;<a title=\"Mangrove\" href=\"https://fr.wikipedia.org/wiki/Mangrove\">mangrove</a>&nbsp;de Basse-Guin&eacute;e, r&eacute;gion qui s&rsquo;appelait &laquo;&nbsp;Rivi&egrave;res du Sud&nbsp;&raquo; au d&eacute;but de la colonisation par les Fran&ccedil;ais, au<a title=\"XIXe si&egrave;cle\" href=\"https://fr.wikipedia.org/wiki/XIXe_si%C3%A8cle\"><abbr class=\"abbr\" title=\"19? si&egrave;cle\"><span class=\"romain\">xix</span><sup>e</sup></abbr>&nbsp;si&egrave;cle</a>.</p>', 'contenu-2', 0, '', '', '', 1, 30, 0, 1, '2016-10-02', '2016-10-02'),
(3, 'Mot du Gouverneur', '', '<h2><span style=\"font-size: 14pt;\">Bienvenue &agrave; tous</span>&nbsp;</h2>\r\n<p><img style=\"float: left; margin: 10px;\" src=\"http://conakry.dev//images/gouv.png\" alt=\"\" width=\"362\" height=\"256\" /></p>\r\n<p>La Ville de Conakry s&rsquo;est dot&eacute;e d&rsquo;un outil d&rsquo;information moderne &agrave; travers la mise en ligne de son portail internet. C&rsquo;est une premi&egrave;re. Il s&rsquo;agit l&agrave; d&rsquo;une &eacute;volution majeure dans le rapport entre la Ville et ses citoyens. Vous avez l&agrave; un canal pour nous suivre, nous faire part aussi de vos r&eacute;flexions autour de nos initiatives. L&rsquo;institution que je dirige tient &agrave; informer et &agrave; rapprocher le citoyen des activit&eacute;s men&eacute;es au quotidien par l&rsquo;administration de la Ville. Notre ambition est de cr&eacute;er les conditions d&rsquo;une participation de tous &agrave; la vie de la collectivit&eacute; et f&eacute;d&eacute;rer toutes les &eacute;nergies autour d&rsquo;un projet commun : le d&eacute;veloppement de Conakry.</p>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"//www.youtube.com/embed/xCRWUW9P3mY\" width=\"744\" height=\"426\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>Citoyens de Conakry et voisins d&rsquo;ailleurs, cet espace est le v&ocirc;tre. Nous sommes &agrave; votre disposition pour &eacute;changer sur notre Ville, ses r&eacute;alit&eacute;s et perspectives. Nous avons besoin de vos id&eacute;es, initiatives et exp&eacute;riences pour nous permettre d&rsquo;avancer, de concevoir et mettre en &oelig;uvre des projets innovants au service de nos populations. Conakry, comme vous le savez sans nul doute, est confront&eacute;e &agrave; d&rsquo;&eacute;normes difficult&eacute;s &agrave; l&rsquo;image de plusieurs autres villes en Afrique et dans le monde. Nous avons besoin de l&rsquo;assainir, de la s&eacute;curiser, de la doter d&rsquo;infrastructures sociales et culturelles, de l&rsquo;ouvrir au monde&hellip; de valoriser la cr&eacute;ativit&eacute; et l&rsquo;innovation de ces habitants. Pour devenir une ville intelligente, Conakry a des atouts de par sa position g&eacute;ographique, son patrimoine historique, sa diversit&eacute; culturelle, ses projets d&rsquo;avenir sans oublier des talents dans de multiples domaines. Pour toutes ces raisons, Conakry est Capitale Mondiale du Livre en 2017.</p>\r\n<p>[code=syJ5v]&nbsp;&nbsp;</p>\r\n<p>Mon objectif en tant que Pr&eacute;sident du Conseil de Ville, en relation avec les diff&eacute;rentes Communes, l&rsquo;Etat, la soci&eacute;t&eacute; civile, le monde de l&rsquo;entreprise, les partenaires techniques et financiers et les citoyens &hellip; est de cr&eacute;er les conditions d&rsquo;un mieux vivre dans notre Ville Capitale en am&eacute;liorant sans cesse la qualit&eacute; de l&rsquo;action publique locale. Je crois en cette d&eacute;marche partenariale pour faire face aux nombreux d&eacute;fis qui assaillent notre cit&eacute;. Ces d&eacute;fis sont certes immenses, mais gr&acirc;ce &agrave; la synergie d&rsquo;action et &agrave; une dynamique collective, nous pouvons y arriver plus vite qu&rsquo;il n&rsquo;y parait. Des retours d&rsquo;exp&eacute;riences v&eacute;cues ailleurs ont montr&eacute; que c&rsquo;est possible. C&rsquo;est &agrave; cet exercice que mon &eacute;quipe et moi, nous nous employons depuis mon arriv&eacute;e &agrave; la t&ecirc;te du Gouvernorat et auquel nous vous invitons &agrave; participer. De la p&eacute;riph&eacute;rie au centre de nos projets et actions, vous &ecirc;tes les t&eacute;moins critiques, des mutations qui affectent notre avenir et notre mieux &ecirc;tre.</p>\r\n<p>Bonne route, ensemble.</p>', 'mot-du-gouverneur', 0, '', '', '', 5, 58, 0, 1, '2016-10-02', '2016-10-02'),
