(8, 'About us', '', '<h2><strong><span style=\"font-size: 24pt;\">ABOUT US</span></strong></h2>\r\n<p>&nbsp;<img style=\"margin-bottom: 10px; margin-top: 10px;\" src=\"http://olam.dev//images/about.jpg\" alt=\"\" width=\"1000\" height=\"291\" />&nbsp;</p>\r\n<p>Founded by Grace Tehe, Olam Events is an independent and unavoidable company of hospitality trades. Olam Events is active in various sectors of activity such as reception in companies, event reception, animation and promotion of sales, cultural reception and finally reception in airport and railway. Olam Events has its own vision of customer service: a relationship of proximity and transparency, with the aim of a partnership and exchange approach to achieve a tailor-made welcome. Our aim is to guarantee at national level our expertise in the hospitality industry and to ensure a quality of service</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h2><strong><span style=\"font-size: 24pt;\">OUR VALUES</span></strong></h2>\r\n<p>&nbsp;<img src=\"http://olam.dev//images/our_values_handshake.jpg\" alt=\"\" width=\"1000\" height=\"300\" /></p>\r\n<p>The ambition of Olam Events: to highlight to its customers the added value brought through its services of reception. The<br />Relations with our clients, relations with our host teams, relations with our partners ... are so many efficient exchanges where everyone has his place and is valued. Proximity in the hosting services of Olam Events is more than an asset, it is a fundamental.<br />We commit ourselves daily to respect, defend and promote our values, whether social, environmental or ethical.</p>', 'about-us', 0, '', '', '', 1, 16, 0, 1, '2016-11-17', '2016-11-17'),
(9, 'Qui sommes-nous ?', '', '<p>Depuis plus de 5 ans,<strong> <img src=\"http://succes.dev//images/logo_puce.png\" alt=\"\" width=\"31\" height=\"15\" />&nbsp;<span style=\"color: #3366ff;\">Succ&egrave;s-Assur&eacute;</span></strong>, Plateforme num&eacute;rique de soutien scolaire, est devenue une r&eacute;f&eacute;rence pour la mise &agrave; disposition gratuite de contenus &eacute;ducatifs aux &eacute;l&egrave;ves en Afrique.Plusieurs fois prim&eacute;s pour son utilit&eacute; et son caract&egrave;re innovant, <img src=\"http://succes.dev//images/logo_puce.png\" alt=\"\" width=\"31\" height=\"15\" />&nbsp;<span style=\"color: #3366ff;\"><strong>Succ&egrave;s-Assur&eacute;</strong></span> est soutenu par l&rsquo;UNESCO, le CEPS et les autorit&eacute;s &eacute;ducatives ivoiriennes.</p>\r\n<p>L&rsquo; organisation internationale &laquo; Africa 4 Tech &raquo; la cite comme une des r &eacute;f&eacute;rences africaines en mati&egrave;re de &laquo; EdTech &raquo;. La qualit&eacute; d&eacute;ploy&eacute;e par l&rsquo;&eacute;quipe de Splash (Propri&eacute;taire de la marque succes-assure.com) lui a value la confiance des marques de renom telles que la Fondation MTN, Orange,&hellip;</p>\r\n<p>Tous les contenus sont r&eacute;dig&eacute;s par une &eacute;quipe d\'auteurs compos&eacute;e exclusivement d\'enseignants de l\'&Eacute;ducation nationale en exercice. Plus de 500 enseignants ont particip&eacute; &agrave; ce jour &agrave; la conception des cours et exercices pr&eacute;sents sur <img src=\"http://succes.dev//images/logo_puce.png\" alt=\"\" width=\"31\" height=\"15\" />&nbsp;<strong><span style=\"color: #3366ff;\">Succ&egrave;s-Assur&eacute;</span></strong> .</p>\r\n<p>Pour chaque discipline, un professeur est le garant de la coh&eacute;rence p&eacute;dagogique. <strong>L\'&eacute;quipe vid&eacute;o</strong> r&eacute;alise toutes ses vid&eacute;os p&eacute;dagogiques avec des &eacute;quipements technologiques numeriques de derni&egrave;re g&eacute;n&eacute;ration dans le studio de tournage dont dispose la soci&eacute;t&eacute; Splash.</p>\r\n<p><strong>L\'&eacute;quipe graphique</strong>, en collaboration avec le p&ocirc;le &eacute;ditorial, r&eacute;alise les illustrations et les animations des cours et des exercices. En collaboration avec le p&ocirc;le commercial, elle con&ccedil;oit tous les supports de communication ainsi que le design de Succ&egrave;s-Assur&eacute; .</p>', 'qui-sommes-nous', 0, '', '', '', 1, 29, 0, 1, '2017-03-09', '2017-03-09'),
(10, 'Mentions légales', '', '<p align=\"center\"><a href=\"http://www.gicop.ci/\"><img src=\"http://gicop.ci//images/logo.png\" alt=\"\" width=\"464\" height=\"378\" /></a></p>\r\n<p align=\"center\"><span style=\"font-size: 18pt;\"><a href=\"http://www.gicop.ci/\">www.gicop.ci</a></span><o:p></o:p></p>\r\n<p align=\"center\">est op&eacute;r&eacute; par la soci&eacute;t&eacute;&nbsp;<strong>GICOP</strong></p>\r\n<p class=\"p1\" align=\"center\"><o:p>&nbsp;</o:p></p>\r\n<p class=\"p1\" align=\"center\">2 Plateaux Vallons Rue des jardins non loin du supermarch&eacute; TopBudget<o:p></o:p></p>\r\n<p align=\"center\"><o:p>&nbsp;</o:p></p>\r\n<p align=\"center\">31 BP 622 Abidjan 31<o:p></o:p></p>\r\n<p align=\"center\">R&eacute;publique de C&ocirc;te d&rsquo;Ivoire<o:p></o:p></p>\r\n<p align=\"center\">T&eacute;l&eacute;phone :(225) 22 009 002<o:p></o:p></p>\r\n<p align=\"center\">Mail : info@gicop.ci / sales@gicop.ci</p>', 'mentions-legales', 0, '', '', '', 1, 198, 0, 1, '2017-03-09', '2017-03-09'),
(11, 'Crédits', '', '<h2>Cr&eacute;dits</h2>\r\n<p>L\'ensemble des contenus (photos, textes, vid&eacute;o, son,...) consultables sur ce site demeure <strong>la propri&eacute;t&eacute; exclusive de la soci&eacute;t&eacute; <span style=\"color: #3366ff;\">SPLASH</span></strong> et/ou de ses partenaires et rel&egrave;ve de la l&eacute;gislation ivoirienne sur le droit d\'auteur et la propri&eacute;t&eacute; intellectuelle. Tous les droits de reproduction sont r&eacute;serv&eacute;s, y compris pour les documents t&eacute;l&eacute;chargeables et les repr&eacute;sentations iconographiques et photographiques.</p>\r\n<p>Toute extraction et/ou reproduction d\'une partie substantielle des informations diffus&eacute;es sur le site est interdite.</p>\r\n<p><strong>Le code de la Propri&eacute;t&eacute; Intellectuelle</strong> pr&eacute;cise qu\'il faut citer la source ou demander l\'autorisation de l\'auteur des images. Il ne joue que dans le cadre du respect du droit d\'auteur. En tant que cr&eacute;ation de l\'esprit, les images (m&ecirc;me les copies d\'&eacute;cran) sont donc prot&eacute;g&eacute;es par le droit d\'auteur.</p>\r\n<p>Le fait de reproduire ou de repr&eacute;senter, sans autorisation, des images, textes ou documents <strong>est punissable sur le plan civil par une condamnation &agrave; des dommages et int&eacute;r&ecirc;ts</strong>.</p>\r\n<h2>Cr&eacute;dits vid&eacute;os</h2>\r\n<p>Vid&eacute;os enti&egrave;rement r&eacute;alis&eacute;es dans le studio de la soci&eacute;t&eacute; <span style=\"color: #3366ff;\"><strong>SPLASH</strong></span>.</p>', 'credits', 0, '', '', '', 1, 5, 0, 1, '2017-03-09', '2017-03-09'),
(12, 'Bienvenue dans la rubrique Questions-Contact', '', '<h2><strong>1) L\'offre d\'accompagnement scolaire en ligne Succ&egrave;s-Assur&eacute;</strong></h2>\r\n<h3><br />A qui s\'adresse Succ&egrave;s-Assur&eacute;?</h3>\r\n<p style=\"padding-left: 30px;\"><br />Succ&egrave;s-Assur&eacute; est une solution d\'accompagnement scolaire qui convient &agrave;<br />tous les &eacute;l&egrave;ves du cp &agrave; la terminale, quel que soit le niveau scolaire :</p>\r\n<p style=\"padding-left: 30px;\">&nbsp;</p>\r\n<p style=\"padding-left: 30px;\">* Si votre enfant ne rencontre pas de difficult&eacute; scolaire particuli&egrave;re, Succ&egrave;s-Assur&eacute;</p>\r\n<p style=\"padding-left: 30px;\">va l\'aider &agrave; revoir l\'ensemble des contenus scolaire sous un nouvel angle, &agrave; gagner en autonomie,<br />&agrave; mieux s\'organiser, &agrave; s\'&eacute;valuer, &agrave; pr&eacute;parer ses examens.</p>\r\n<p style=\"padding-left: 30px;\"><br />* Si votre enfant est en difficult&eacute; scolaire dans une mati&egrave;re ou dans toutes les mati&egrave;res<br />Succ&egrave;s-Assur&eacute; lui permet de s\'am&eacute;liorer en revoyant les notions incomprises en<br />classe et en faisant des exercices interactifs. Chaque &eacute;l&egrave;ve dispose d\'un acc&egrave;s aux ressources de<br />la classe inf&eacute;rieure pour lui permettre de revenir sur les points du programme qu\'il ne ma&icirc;trisait<br />pas encore.</p>\r\n<p style=\"padding-left: 30px;\"><br />* Si votre enfant a de grandes facilit&eacute;s au niveau scolaire,<br />Succ&egrave;s-Assur&eacute; lui permet de s\'avancer et de progresser en d&eacute;couvrant le programme<br />de l\'ann&eacute;e en cours et &eacute;ventuellement celui de la classe sup&eacute;rieure.</p>\r\n<h3><br />Succ&egrave;s-Assur&eacute; est-il suffisant pour de l\'enseignement scolaire &agrave; la maison ?</h3>\r\n<p style=\"padding-left: 30px;\"><br />Il est un outil d\'accompagnement scolaire complet qui regroupe tout le programme<br />conforme de l\'&Eacute;ducation nationale du CP &agrave; la Terminale, dans toutes les mati&egrave;res.<br />Cependant, c\'est un support qui ne se substitue pas &agrave; la pr&eacute;sence d\'un enseignant<br />pour pr&eacute;parer l\'apprentissage et suivre chaque &eacute;l&egrave;ve.</p>\r\n<h2><br /><strong>2) Les ressources p&eacute;dagogiques Succ&egrave;s-Assur&eacute;</strong></h2>\r\n<h3><br />Quels sont les contenus p&eacute;dagogiques du service ?</h3>\r\n<p style=\"padding-left: 30px;\"><br />* Succ&egrave;s-Assur&eacute; s\'adresse &agrave; tous les &eacute;l&egrave;ves de primaire, de coll&egrave;ge et de<br />lyc&eacute;e, en fili&egrave;res g&eacute;n&eacute;rales, et propose des contenus conformes aux<br />programmes officiels de l\'&Eacute;ducation nationale pour toutes les mati&egrave;res.<br />Succ&egrave;s-Assur&eacute; propose plus de 1000 cours, 700 vid&eacute;os et plus de 1000<br />exercices interactifs, de nombreux outils p&eacute;dagogiques tels que le live<br />facebook qui donne la possibilit&eacute; &agrave; l&rsquo;aprenant &agrave; int&eacute;ragir sur des cours en<br />direct avec un enseignant. Pour les plus jeunes, Succ&egrave;s-Assur&eacute; propose<br />des outils plus ludiques tels qu\'un jeu d\'apprentissage des tables de<br />multiplication et un outil de tra&ccedil;age des chiffres et des lettres.</p>\r\n<h3><br />Les programmes sont-ils conformes &agrave; ceux de l\'Education nationale ?</h3>\r\n<p style=\"padding-left: 30px;\"><br />* Tous les programmes de Succ&egrave;s-Assur&eacute; sont conformes &agrave; ceux de l\'&Eacute;ducation<br />nationale. A chaque changement de programme, Succ&egrave;s-Assur&eacute; met &agrave; jour<br />ses contenus dans les meilleurs d&eacute;lais.</p>\r\n<h3><br />Qui r&eacute;dige les cours et les exercices ?</h3>\r\n<p style=\"padding-left: 30px;\"><br />*Tous nos contenus p&eacute;dagogiques sont r&eacute;alis&eacute;s par des enseignants de l\'&Eacute;ducation<br />nationale, en poste dans les classes pour lesquelles ils cr&eacute;ent les ressources<br />p&eacute;dagogiques. Depuis sa cr&eacute;ation, plus de 500 professeurs de l\'&Eacute;ducation nationale<br />ont con&ccedil;u le contenu de Succ&egrave;s-Assur&eacute; .</p>\r\n<h3><br />Les contenus sont-ils renouvel&eacute;s r&eacute;guli&egrave;rement ?</h3>\r\n<p style=\"padding-left: 30px;\"><br />* Succ&egrave;s-Assur&eacute; prend en compte dans la mesure du possible les demandes<br />d\'&eacute;volution de ses utilisateurs.<br />De nouveaux contenus et de nouvelles fonctionnalit&eacute;s sont donc r&eacute;guli&egrave;rement<br />ajout&eacute;s dans toutes les mati&egrave;res et toutes les classes.</p>\r\n<h2>&nbsp;</h2>\r\n<h2><strong>3) L\'acc&egrave;s &agrave; la plateforme Succ&egrave;s-Assur&eacute;</strong></h2>\r\n<h3><br />Quand puis-je acc&eacute;der aux contenus du service ?</h3>\r\n<p style=\"padding-left: 30px;\"><br />Vous pouvez acc&eacute;der aux contenus lorsque votre souscription a bien &eacute;t&eacute; valid&eacute;e et<br />confirm&eacute;e par mail. Vous recevez alors vos identifiants et pouvez commencer vos<br />r&eacute;visions sur notre site. Si vous n\'avez pas r&eacute;ceptionn&eacute; ce mail de confirmation,<br />contactez notre service client.</p>\r\n<h3><br />Puis-je acc&eacute;der &agrave; Succ&egrave;s-Assur&eacute; de n\'importe quel endroit et &agrave;<br />n\'importe quel moment ?</h3>\r\n<p style=\"padding-left: 30px;\"><br />Oui, vous pouvez acc&eacute;der &agrave; notre plateform depuis n\'importe quel endroit<br />et &agrave; n\'importe quel moment :</p>\r\n<p style=\"padding-left: 30px;\"><br />&bull; En mode connect&eacute; depuis votre ordinateur, tablette ou t&eacute;l&eacute;phone mobile.</p>\r\n<p style=\"padding-left: 30px;\"><br />&bull; En mode d&eacute;connect&eacute; en t&eacute;l&eacute;chargeant l\'application sur Googleplay ou<br />l\'Appstore.(En cours)</p>\r\n<p style=\"padding-left: 30px;\">&nbsp;</p>\r\n<h3>Quel est le mat&eacute;riel n&eacute;cessaire pour utiliser le service ?</h3>\r\n<p style=\"padding-left: 30px;\"><br />&bull; Depuis votre ordinateur :</p>\r\n<p style=\"padding-left: 30px;\"><br />- Pour travailler sur Succ&egrave;s-Assur&eacute;, vous avez uniquement besoin d\'un<br />ordinateur &eacute;quip&eacute; d\'un navigateur Internet Explorer avec au moins la version 7,<br />Mozilla, Firefox, Netscape ou Safari et d\'une connexion Internet.</p>\r\n<p style=\"padding-left: 30px;\"><br />&bull; Depuis votre t&eacute;l&eacute;phone mobile ou votre tablette :</p>\r\n<p style=\"padding-left: 30px;\"><br />- Vous pouvez travailler sur Succ&egrave;s-Assur&eacute; en vous connectant depuis un<br />t&eacute;l&eacute;phone mobile ou une tablette &eacute;quip&eacute; d\'un navigateur Internet.<br />Vous pouvez travailler sur Succ&egrave;s-Assur&eacute; en mode connect&eacute; et d&eacute;connect&eacute;<br />en t&eacute;l&eacute;chargeant l\'application sur les stores Googleplay et Appstore(En<br />cours)</p>\r\n<h3><br />J\'ai une connexion ADSL, est-ce que je peux travailler sur le service ?</h3>\r\n<p style=\"padding-left: 30px;\"><br />Une connexion classique suffit pour les principaux outils. Cependant, une<br />connexion ADSL 512Ko ou plus est recommand&eacute;e afin de limiter le temps<br />d\'acc&egrave;s aux vid&eacute;os.</p>\r\n<h3><br />Comment visionner les vid&eacute;os ou les animations ?</h3>\r\n<p style=\"padding-left: 30px;\"><br />Pour visualiser nos vid&eacute;os sur Succ&egrave;s-Assur&eacute;, il vous faut un acc&egrave;s<br />Internet Haut D&eacute;bit, avec une bande passante en download (les informations<br />qui arrivent chez vous) d\'au moins 512Kb/s. Les fournisseurs d\'acc&egrave;s<br />annoncent dans leur offre le d&eacute;bit maximal que vous pouvez avoir, mais<br />votre d&eacute;bit r&eacute;el est parfois diff&eacute;rent.<br /><br /></p>\r\n<h2><strong>4) Autres questions</strong></h2>\r\n<p>&nbsp;</p>', 'bienvenue-dans-la-rubrique-questions-contact', 0, '', '', '', 1, 14, 0, 1, '2017-03-13', '2017-03-13'),
(13, 'Espace presse', '', '<h1>Obtenir des informations suppl&eacute;mentaires ?</h1>\r\n<p><br /><strong>Pour les internautes :</strong> un espace revue de presse pour d&eacute;couvrir tous les articles&nbsp;sur <a href=\"http://www.gicop.ci\">www.gicop.ci</a></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Pour les professionnels des m&eacute;dias</strong> : un espace journaliste o&ugrave; vous trouverez nos<br />derniers communiqu&eacute;s, un dossier de presse, le logo et des visuels du site. Destin&eacute; &agrave;<br />un usage professionnel.</p>\r\n<p>&nbsp;</p>', 'espace-presse', 0, '', '', 'Plan de travail 3 copie 3-100.jpg', 1, 108, 0, 1, '2017-03-13', '2017-03-13'),
