(16, 'DECOUVREZ NETBACKUP APPLIANCE', '', '<h2>DECOUVREZ NETBACKUP APPLIANCE</h2>\r\n<p>&nbsp;</p>\r\n<p style=\"border: 1px solid #ddd;\"><iframe src=\"https://apps.kaonadn.net/6210336432586752/product.html#nbu_marketing;:\" width=\"100%\" height=\"580\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'decouvrez-netbackup-appliance', 0, '', '', '', 1, 41, 0, 1, '2017-04-18', '2017-04-18'),
(17, 'Présentation', '', '<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h2 style=\"text-align: left;\"><img style=\"float: right; margin-left: 20px; margin-right: 20px;\" src=\"/images/safe_image_1.jpg\" alt=\"\" width=\"567\" height=\"391\" />QUI SOMMES NOUS</h2>\r\n<p style=\"text-align: left;\">EKARDIST est un int&eacute;grateur de solutions et de services informatiques sp&eacute;cialis&eacute;e dans&nbsp;:</p>\r\n<ul style=\"text-align: left;\">\r\n<li>\r\n<div class=\"O2\">L&rsquo;implementation de solutions informatiques</div>\r\n</li>\r\n<li>\r\n<div class=\"O2\">Le support</div>\r\n</li>\r\n<li>\r\n<div class=\"O2\">La Formation / Transfert de comp&eacute;tences</div>\r\n</li>\r\n<li>\r\n<div class=\"O2\">Le conseil &amp; l&rsquo;audit</div>\r\n</li>\r\n<li>\r\n<div class=\"O2\">L&rsquo;outsourcing</div>\r\n</li>\r\n</ul>\r\n<div style=\"text-align: left;\"><span style=\"font-size: 14pt;\"><strong>EKARDIST est le partenaire exclusif de support des Appliance Netbackup de VERITAS <br />TECHNOLOGIES sur l&rsquo;Afrique Francophone.<br /></strong></span></div>\r\n<div style=\"text-align: left;\">&nbsp;</div>\r\n<div class=\"clear\">&nbsp;</div>\r\n<h2>&nbsp;</h2>\r\n<h2>COUVERTURE GEOGRAPHIQUE</h2>\r\n<p>EKARDIST couvre tous les pays de l&rsquo;Afrique Francophone (voir les pays en Vert).</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://ekardist.dev//images/Image1.png\" alt=\"\" width=\"488\" height=\"489\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'presentation', 0, '', '', '', 1, 143, 0, 1, '1899-11-30', '2017-04-22'),
(18, 'Discover NETBACKUP APPLIANCE', '', '<h2>DISCOVER NETBACKUP APPLIANCE</h2>\r\n<p>&nbsp;</p>\r\n<p style=\"border: 1px solid #ddd;\"><iframe src=\"https://apps.kaonadn.net/6210336432586752/product.html#nbu_marketing;:\" width=\"100%\" height=\"580\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'discover-netbackup-appliance', 0, '', '', '', 1, 10, 0, 1, '2017-04-25', '2017-04-25'),
(19, 'About US', '', '<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h2 style=\"text-align: left;\"><img style=\"float: right; margin-left: 20px; margin-right: 20px;\" src=\"/images/safe_image_1.jpg\" alt=\"\" width=\"567\" height=\"391\" />WHO ARE WE</h2>\r\n<p>EKARDIST is an IT solutions and services integrator specialized in:</p>\r\n<ul style=\"text-align: left;\">\r\n<li>\r\n<div class=\"O2\">\r\n<div class=\"O2\">IT Solution implementation</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"O2\">\r\n<div class=\"O2\">Hardware support, diagnostic and break fix</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"O2\">\r\n<div class=\"O2\">Training</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"O2\">\r\n<div class=\"O2\">Healf check</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"O2\">\r\n<div class=\"O2\">Outsourcing</div>\r\n</div>\r\n</li>\r\n</ul>\r\n<div style=\"text-align: left;\"><span style=\"font-size: 14pt;\"><strong>EKARDIST is Veritas exclusive TSPP (Technichal Support Partner ) for Veritas <br />Netbackup Appliances in French Speaking Africa / West and Central Africa. <br /></strong></span></div>\r\n<div style=\"text-align: left;\">&nbsp;</div>\r\n<div class=\"clear\">&nbsp;</div>\r\n<h2>&nbsp;</h2>\r\n<h2>COVERAGE EREA</h2>\r\n<p>EKARDIST support all the French Speaking and some English Speaking Africa countries ) All West and Central Africa. (See Green Countries).</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://ekardist.dev//images/Image1.png\" alt=\"\" width=\"488\" height=\"489\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'about-us', 0, '', '', '', 1, 13, 0, 1, '2017-04-26', '2017-04-26'),
(20, 'services en', '', '<h2>&nbsp;</h2>\r\n<h2>SERVICES</h2>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt;\">Support for veritas Netackup Appliances.</span></li>\r\n<li><span style=\"font-size: 12pt;\">Professionnal services / Implementation of all Veritas products such as:</span></li>\r\n<li><span style=\"font-size: 12pt;\">Veritas Netbackup Appliances</span></li>\r\n<li><span style=\"font-size: 12pt;\">Veritas Netbackup Software</span></li>\r\n<li><span style=\"font-size: 12pt;\">Veritas Infoscale</span></li>\r\n<li><span style=\"font-size: 12pt;\">Veritas Enterprise Vault</span></li>\r\n<li><span style=\"font-size: 12pt;\">Veritas Backup Exec</span></li>\r\n<li><span style=\"font-size: 12pt;\">Consulting Services / Healf Check in Veritas Netbackup</span></li>\r\n<li><span style=\"font-size: 12pt;\">Training</span></li>\r\n<li><span style=\"font-size: 12pt;\">Etc&hellip;</span></li>\r\n</ul>', 'services-en', 0, '', '', '', 1, 15, 0, 0, '2017-04-26', '2017-04-26'),
(21, 'services fr', '', '<h2>&nbsp;</h2>\r\n<h2>SERVICES</h2>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Support des Appliances Veritas</li>\r\n<li>Impl&eacute;mentation de tous les produits&nbsp; Veritas a savoir:&nbsp;</li>\r\n<li><span style=\"font-size: 12pt;\">Veritas Netbackup Appliances</span></li>\r\n<li><span style=\"font-size: 12pt;\">Veritas Netbackup Software</span></li>\r\n<li><span style=\"font-size: 12pt;\">Veritas Infoscale</span></li>\r\n<li><span style=\"font-size: 12pt;\">Veritas Enterprise Vault</span></li>\r\n<li><span style=\"font-size: 12pt;\">Veritas Backup Exec</span></li>\r\n<li>\r\n<div>Conseil et audit en Veritas Netbackup ( Healf Check )</div>\r\n</li>\r\n<li>\r\n<div>Transfert de comp&eacute;tences / Formation</div>\r\n</li>\r\n<li><span style=\"font-size: 12pt;\">Etc&hellip;</span></li>\r\n</ul>', 'services-fr', 0, '', '', '', 1, 18, 0, 0, '2017-04-26', '2017-04-26'),
(22, 'Services 2 en', '', '<div class=\"grand_titre\"><strong>Products and Services</strong></div>\r\n<ul class=\"produits\">\r\n<li class=\"item_produit\">VERITAS NETBACKUP APPLIANCE\r\n<div class=\"wrap_img_product\"><img src=\"&lt;?= WEBROOT ?&gt;img/nbua-hero-overview-card.png\" alt=\"backup\" width=\"100%\" /></div>\r\n<p>The NetBackup Appliances feature the entire NetBackup Platform suite on performance and cost-optimized hardware&mdash;a single turnkey solution for backup, storage, and deduplication.</p>\r\n<a href=\"https://www.veritas.com/product/backup-and-recovery/netbackup-appliances\">View Details </a></li>\r\n<li class=\"item_produit\">VERITAS NETBACKUP SOFTWARE\r\n<div class=\"wrap_img_product\"><img src=\"&lt;?= WEBROOT ?&gt;img/RelatedItem_NetBackup_Hero_281x203.jpg\" alt=\"backup\" width=\"100%\" /></div>\r\n<p>NetBackup reduces the complexity of enterprise data protection, scales with growth, and increases agility so IT can transform from cost center to business enabler.</p>\r\n<a href=\"https://www.veritas.com/product/backup-and-recovery/netbackup\">View Details </a></li>\r\n<li class=\"item_produit\">VERITAS INFOSCALE\r\n<div class=\"wrap_img_product\"><img src=\"&lt;?= WEBROOT ?&gt;img/infoscale-hero-overview-card.png\" alt=\"backup\" width=\"100%\" /></div>\r\n<p>InfoScale Enterprise offers world-class software-defined storage, availability and management for hybrid clouds.</p>\r\n<a href=\"https://www.veritas.com/product/software-defined-storage/infoscale-enterprise\">View Details </a></li>\r\n<li class=\"item_produit\">VERITAS ENTERPRISE VAULT\r\n<div class=\"wrap_img_product\"><img src=\"&lt;?= WEBROOT ?&gt;img/ev-hero-overview-card.png\" alt=\"backup\" width=\"100%\" /></div>\r\n<p>Veritas Enterprise Vault helps automate retention management, classification and supervision, while simplifying search and eDiscovery over unstructured data.</p>\r\n<a href=\"https://www.veritas.com/product/information-governance/enterprise-vault\">View Details </a></li>\r\n<li class=\"item_produit\">VERITAS BACKUP EXEC\r\n<div class=\"wrap_img_product\"><img src=\"&lt;?= WEBROOT ?&gt;img/be-hero-overview-card.png\" alt=\"backup\" width=\"100%\" /></div>\r\n<p>Veritas Backup Exec protects all your data across virtual, physical and cloud. Powerful performance and simple administration in one cost-effective solution.</p>\r\n<a href=\"https://www.veritas.com/product/backup-and-recovery/backup-exec\">View Details </a></li>\r\n<li class=\"item_produit\"></li>\r\n</ul>', 'services-2-en', 0, '', '', '', 1, 12, 0, 0, '2017-05-12', '2017-05-12'),
(23, 'Mot du Manager', '', '<p><strong><img style=\"float: left; margin-right: 50px;\" src=\"/images/vv.jpg\" alt=\"\" width=\"500\" height=\"\" />KBS GUINEE</strong>&nbsp;est une entreprise africaine cr&eacute;e sur fond propre qui entend grandir et se p&eacute;renniser.</p>\r\n<p>Elle est dirig&eacute;e et emploie une &eacute;quipe de jeunes personnes bien form&eacute;es dot&eacute;es d&rsquo;un professionnalisme av&eacute;r&eacute; et d&rsquo;une int&eacute;grit&eacute; irr&eacute;prochable.</p>\r\n<p>Notre r&ocirc;le de Manager est de d&eacute;finir des orientations claires qui ne souffrent d&rsquo;aucune ambig&uuml;it&eacute;.&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>&nbsp;Pour mener &agrave; bien notre politique int&eacute;gr&eacute;e, je m&rsquo;engage &agrave; doter l&rsquo;entreprise des moyens ad&eacute;quats&nbsp; afin qu&rsquo;elle puisse s&rsquo;appuyer sur des &eacute;quipes motiv&eacute;es, performantes, respectueuses des personnes, et &agrave; d&eacute;ployer au sein de l&rsquo;entreprise les&nbsp;<strong>6 valeurs guides</strong>&nbsp; de&nbsp; KBS GUINEE,&nbsp; &agrave; savoir&nbsp;<strong>:</strong></p>\r\n<p><strong>Satisfaction&nbsp; client,</strong></p>\r\n<p><strong>Esprit&nbsp; d&rsquo;Entreprise,&nbsp;</strong></p>\r\n<p><strong>Esprit d&rsquo;Equipe,&nbsp;</strong></p>\r\n<p><strong>Communication,</strong></p>\r\n<p><strong>Rigueur,</strong></p>\r\n<p><strong>Cr&eacute;ativit&eacute;.</strong></p>', 'mot-du-manager', 0, '', '', '', 1, 11, 0, 1, '2017-05-23', '2017-05-23'),
(24, 'Mot du Manager', '', '<p><span style=\"font-size: small;\"><img style=\"float: right;\" src=\"/images/vv.jpg\" alt=\"\" width=\"350\" border=\"0\" /><span style=\"color: #333399;\"><strong>KBS GUINEE</strong></span> est une entreprise africaine cr&eacute;e sur fond propre qui entend grandir et se p&eacute;renniser. Elle est dirig&eacute;e et emploie une &eacute;quipe de jeunes personnes bien form&eacute;es dot&eacute;es d&rsquo;un professionnalisme av&eacute;r&eacute; et d&rsquo;une int&eacute;grit&eacute; irr&eacute;prochable.</span></p>\r\n<p><span style=\"font-size: small;\">Notre r&ocirc;le de Manager est de d&eacute;finir des orientations claires qui ne souffrent d&rsquo;aucune ambig&uuml;it&eacute;. </span></p>\r\n<p><span style=\"font-size: small;\"> Pour mener &agrave; bien notre politique int&eacute;gr&eacute;e, je m&rsquo;engage &agrave; doter l&rsquo;entreprise des moyens ad&eacute;quats afin qu&rsquo;elle puisse s&rsquo;appuyer sur des &eacute;quipes motiv&eacute;es, performantes, respectueuses des personnes, et &agrave; d&eacute;ployer au sein de l&rsquo;entreprise les <span style=\"color: #ff9900;\"><strong>6 valeurs guides</strong></span> de KBS GUINEE, &agrave; savoir <strong>: </strong></span></p>\r\n<p><span style=\"font-size: small;\"><strong>Satisfaction client, </strong></span></p>\r\n<p><span style=\"font-size: small;\"><strong>Esprit d&rsquo;Entreprise, </strong></span></p>\r\n<p><span style=\"font-size: small;\"><strong>Esprit d&rsquo;Equipe, </strong></span></p>\r\n<p><span style=\"font-size: small;\"><strong>Communication, </strong></span></p>\r\n<p><span style=\"font-size: small;\"><strong>Rigueur, </strong></span></p>\r\n<p><span style=\"font-size: small;\"><strong>Cr&eacute;ativit&eacute;.</strong></span></p>', 'mot-du-manager', 0, '', '', '', 1, 28, 0, 1, '2017-05-23', '2017-05-23'),
(25, 'Notre Vision', '', '<p style=\"text-align: justify;\"><span style=\"font-size: small;\"><span style=\"line-height: 1.3em;\"><img style=\"float: right; margin-left: 50px;\" src=\"/images/notrevision2.jpg\" alt=\"\" border=\"0\" />Comme toutes les grandes entreprises aujourd&rsquo;hui de renomm&eacute;es internationales, nous voulons cr&eacute;er un model type africain avec des comp&eacute;tences prouv&eacute;es, incontestables et appropri&eacute;es.</span></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: small;\"> La conjugaison de bonnes comp&eacute;tences, le dynamisme impuls&eacute; et fraicheur de notre &eacute;quipe nous conduiront inexorablement &agrave; cet objectif &agrave; travers une organisation maitris&eacute;e et une vision collective bien d&eacute;finie.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: small;\">Conscient des changements perp&eacute;tuels de notre domaine d&rsquo;activit&eacute;, nous voulons &ecirc;tre &agrave; la hauteur de la t&acirc;che et relever tous les challenges avec pour ce but servir et satisfaire le client, en tous temps et en tous lieux.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: small;\">Cela constitue pour chaque employ&eacute; de l&rsquo;entreprise, le d&eacute;fi quotidien : <span style=\"color: #ff9900;\"><strong>SERVIR LE CLIENT </strong></span></span></p>', 'notre-vision', 0, '', '', '', 1, 27, 0, 1, '2017-05-23', '2017-05-23');
INSERT INTO `contenus` (`id`, `libelle_fr`, `intro_fr`, `description_fr`, `slug_fr`, `type_contenu`, `meta_title_fr`, `meta_desc_fr`, `image`, `ordre`, `nbr_vues`, `valid`, `statut`, `date_pub`, `date_enreg`) VALUES
(26, 'Notre histoire', '', '<p><span style=\"font-size: small;\"><img style=\"float: right; margin-left: 50px;\" src=\"/images/Notre%20histoire.jpg\" alt=\"\" width=\"328\" height=\"220\" border=\"0\" />Elle est simple et presque banale.</span></p>\r\n<p><span style=\"font-size: small;\">Elle d&eacute;bute en 2012 quand nous r&eacute;alisons que nous pouvons nous exprimer autrement dans ces domaines d&rsquo;activit&eacute;s que nous adorons et qui nous ont occup&eacute;s des ann&eacute;es durant.</span></p>\r\n<p><span style=\"font-size: small;\">Apr&egrave;s des ann&eacute;es de formation dans les plus &eacute;minentes &eacute;coles de transport multimodal et de logistique, nous avons eu l&rsquo;occasion d&rsquo;exercer dans des multinationales &eacute;voluant dans l&rsquo;industrie maritime et portuaires.</span></p>\r\n<p><span style=\"font-size: small;\">Dans un souci de r&eacute;ellement adapter les besoins du march&eacute; aux offres qui n&rsquo;&eacute;tait pas le cas naquit alors l&rsquo;id&eacute;e de l&rsquo;entreprenariat en vu de donner une r&eacute;ponse &agrave; cette probl&eacute;matique et surtout participer &agrave; la cr&eacute;ation d&rsquo;emploi et aussi participer &agrave; la vie &eacute;conomique de notre continent.</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff9900;\"><strong><span style=\"font-size: small;\">Le 15 mai 2012 f&ucirc;t alors cr&eacute;e l&rsquo;entreprise FUNAI RESOURCES qui &acirc;pres des mutations est depuis 18 septembre 2014 KASY BUSINESS SARL GUINEE (KBS GUINEE).</span></strong></span></p>\r\n<p><span style=\"font-size: small;\">Nous sommes &agrave; la tache et nous voulons prendre notre place &agrave; la fois r&eacute;gionale, continentale et internationale.</span></p>', 'notre-histoire', 0, '', '', '', 1, 28, 0, 1, '2017-05-23', '2017-05-23'),
(27, 'Environnement/Sécurité/Qualité', '', '<p><span style=\"font-size: small;\"><br /><strong><img style=\"float: right; margin-left: 50px;\" src=\"/images/qse.jpg\" alt=\"\" border=\"0\" /></strong>La Qualit&eacute;, la S&eacute;curit&eacute;, et la protection de l&rsquo;environnement sont des th&egrave;mes prioritaires Sur lesquels KBS GUINEE, porte une Attention particuli&egrave;re.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: small;\">L&rsquo;&eacute;volution du contexte r&eacute;glementaire et les exigences grandissantes de nos clients en Mati&egrave;re d&rsquo;Hygi&egrave;ne, S&eacute;curit&eacute; et Environnement (GEHSE, UIC, OHSAS), de plus en plus Pr&eacute;sentes, Conditionnent notre syst&egrave;me de Management Int&eacute;gr&eacute; et nous conduisent &agrave; Repenser en permanence notre projet d&rsquo;entreprise.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: small;\"><strong>Dans ce cadre, <span style=\"color: #ff9900;\">KBS GUINE</span>E confirme sa volont&eacute; d&rsquo;am&eacute;lioration continue en Poursuivant sa politique Qualit&eacute;, Sant&eacute;-S&eacute;curit&eacute; et Environnement, bas&eacute;e sur</strong></span></p>\r\n<p><span style=\"font-size: small; color: #ff9900;\"><strong>6 ambitions fondatrices</strong> :</span></p>\r\n<p><span style=\"font-size: small;\"> Pour parvenir &agrave; satisfaire nos ambitions, les actions d&eacute;j&agrave; entreprises en mati&egrave;re de Qualit&eacute;, de S&eacute;curit&eacute; et d&rsquo;Environnement, doivent &ecirc;tre renforc&eacute;es :</span></p>\r\n<ul>\r\n<li><span style=\"font-size: small;\">L&rsquo;&eacute;coute du client,</span></li>\r\n<li><span style=\"font-size: small;\">L&rsquo;identification des risques Hygi&egrave;ne S&eacute;curit&eacute; Environnement et la mise en place des moyens de ma&icirc;trise,</span></li>\r\n<li><span style=\"font-size: small;\">La gestion de situations dangereuses,</span></li>\r\n<li><span style=\"font-size: small;\">Une politique volontaire de formation et de d&eacute;veloppement des personnes,</span></li>\r\n<li><span style=\"font-size: small;\">La pratique syst&eacute;matique de l&rsquo;int&eacute;gration et de l&rsquo;entretien annuel individuel,</span></li>\r\n<li><span style=\"font-size: small;\">L&rsquo;analyse de la qualit&eacute; et de la conformit&eacute; de notre travail &agrave; travers des &eacute;valuations </span><span style=\"font-size: small; line-height: 1.3em;\">des audits </span></li>\r\n</ul>\r\n<p><span style=\"font-size: small; line-height: 1.3em;\">- </span><span style=\"font-size: small; line-height: 1.3em;\">Le respect de nos obligations r&eacute;glementaires, l&eacute;gislatives, contractuelles ou autres,</span></p>\r\n<p><span style=\"font-size: small;\">- La communication renforc&eacute;e, r&eacute;guli&egrave;re et transparente avec nos clients, </span><span style=\"font-size: small; line-height: 1.3em;\">collaborateurs,</span></p>\r\n<p><span style=\"font-size: small; line-height: 1.3em;\">- L&rsquo;application stricte des consignes de <strong>KBS GUINEE</strong>.</span></p>\r\n<p><span style=\"font-size: small;\">Notre syst&egrave;me Qualit&eacute;, S&eacute;curit&eacute;, Environnement doit &eacute;voluer dans une logique permanente d&rsquo;am&eacute;lioration continue et s&rsquo;&eacute;tendre &agrave; l&rsquo;ensemble des processus clefs de L&rsquo;Entreprise, allant de l&rsquo;offre commerciale, la r&eacute;alisation de nos chantiers conform&eacute;ment aux r&egrave;gles de l&rsquo;art, mais aussi &agrave; la ma&icirc;trise de nos achats et &agrave; la gestion du recouvrement.</span></p>\r\n<p><span style=\"font-size: small;\"><strong>Afin que notre syst&egrave;me de management int&eacute;gr&eacute; montre notre objectif premier de conformit&eacute; avec les exigences de nos clients. </strong></span></p>\r\n<p><span style=\"font-size: small;\"><strong>Nous nous sommes fix&eacute;s les axes d&rsquo;am&eacute;lioration suivants : </strong></span></p>\r\n<p><span style=\"font-size: small; color: #ff9900;\"><strong>Nos objectifs Qualit&eacute;s :</strong></span></p>\r\n<table style=\"width: 680px; height: 142px;\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-size: small;\">- Poursuivre et faire vivre les plans d&rsquo;actions &agrave; tous niveaux,</span></p>\r\n<p><span style=\"font-size: small;\">- Mesurer p&eacute;riodiquement la satisfaction de nos clients, recueillir et anticiper leurs besoins et attentes,</span></p>\r\n<p><span style=\"font-size: small;\">- Analyser et ma&icirc;triser les risques de dysfonctionnement par de revues de contrat, des suivis de prestation, des audits de site et chantiers, des &eacute;valuations de fournisseurs.</span></p>\r\n<p><span style=\"font-size: small;\">- Communiquer notre politique QSE &agrave; l&rsquo;ensemble du personnel et parties int&eacute;ress&eacute;es (clients, administrations, riverains) et nous assurer qu&rsquo;elle soit connue et comprise de tous.</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style=\"font-size: small; color: #ff9900;\"><strong>Nos objectifs Sant&eacute; et S&eacute;curit&eacute; :</strong></span></p>\r\n<table style=\"width: 680px; height: 237px;\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-size: small;\">- Identifier les risques et mettre en &oelig;uvre des actions visant &agrave; les diminuer et &agrave; les ma&icirc;triser</span></p>\r\n<p><span style=\"font-size: small;\">- D&eacute;velopper la culture Sant&eacute;-S&eacute;curit&eacute; et sensibiliser le personnel aux risques et &agrave; leur ma&icirc;trise,</span></p>\r\n<p><span style=\"font-size: small;\">- Cr&eacute;er et maintenir les conditions de travail permettant de pr&eacute;venir les maladies professionnelles et d&rsquo;atteindre les objectifs fix&eacute;s par KBS GUINEE &agrave; savoir :</span></p>\r\n<p><span style=\"font-size: small;\">- R&eacute;duire d&rsquo;ici 2017 notre taux de fr&eacute;quence d&rsquo;accidents de travail avec arr&ecirc;t &agrave; moins de 03 et notre taux de gravit&eacute; &agrave; moins de 0,95 </span></p>\r\n<p><span style=\"font-size: small;\">- R&eacute;duire de 5% par an le nombre d&rsquo;accidents de la circulation,</span></p>\r\n<p><span style=\"font-size: small;\">- Analyser 100% des accidents du travail et de la route</span></p>\r\n<p><span style=\"font-size: small;\">- Analyser en amont les presque-accidents.</span></p>\r\n<p><span style=\"font-size: small;\">- Sensibiliser l&rsquo;ensemble de notre personnel et de nos sous-traitants &agrave; notre d&eacute;marche HSAS 18001 et UIC. </span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style=\"font-size: small; color: #ff9900;\"><strong>Nos objectifs Environnement :</strong></span></p>\r\n<table style=\"width: 680px; height: 117px;\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-size: small;\">- Am&eacute;liorer la qualit&eacute; de nos rejets gazeux,</span></p>\r\n<p><span style=\"font-size: small;\">- R&eacute;duire la consommation d&rsquo;&eacute;nergie,</span></p>\r\n<p><span style=\"font-size: small;\">- Sensibiliser l&rsquo;ensemble de notre personnel et de nos sous-traitants &agrave; notre d&eacute;marche ISO 14001,</span></p>\r\n<p><span style=\"font-size: small;\">- Ma&icirc;triser les d&eacute;versements accidentels et les nuisances pour notre Voisinage,</span></p>\r\n<p><span style=\"font-size: small;\">- Optimiser le tri et la revalorisation de nos d&eacute;chets.</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'environnement-securite-qualite', 0, '', '', '', 1, 56, 0, 1, '2017-05-23', '2017-05-23'),
(28, 'Qui sommes nous', '', '<h2><strong>Que signifie GICOP&nbsp;?</strong></h2>\r\n<p>&nbsp;</p>\r\n<p>Groupe Ivoirien de Cosm&eacute;tiques et de parfumeries</p>\r\n<p>&nbsp;</p>\r\n<h2><strong>Notre mission&nbsp;:</strong></h2>\r\n<p>&nbsp;</p>\r\n<p>Sublimer votre beaut&eacute;</p>\r\n<p>&nbsp;</p>\r\n<h2><strong>Qui sommes-nous&nbsp;?</strong>&nbsp;</h2>\r\n<p>GICOP est une entreprise cr&eacute;&eacute;e en 1996 qui exerce dans la fabrication et la commercialisation de produits de beaut&eacute;.&nbsp;</p>\r\n<p>Notre expertise dans le domaine nous donne d&rsquo;avoir les meilleurs produits de meilleure qualit&eacute; sur le march&eacute; ivoirien et de la sous-r&eacute;gion.&nbsp;</p>\r\n<p>Depuis notre existence nous avons cr&eacute;&eacute; plus de 24 gammes de produits cosm&eacute;tiques.&nbsp;</p>\r\n<p>Nous excellons dans notre domaine et nous en sommes fiers.&nbsp;</p>\r\n<h2><strong>Notre constat</strong>&nbsp;</h2>\r\n<p>Nombreux sont les produits qui viennent d&rsquo;ailleurs et d&rsquo;autres fabriqu&eacute;s en C&ocirc;te d&rsquo;Ivoire mais quels sont ceux qui prennent en compte les r&eacute;alit&eacute;s de nos pays africains qui sont&nbsp;:</p>\r\n<p>&nbsp;</p>\r\n<p>Les climats&nbsp;</p>\r\n<p>Les difficult&eacute;s&nbsp;: Travailler dans des domaines difficilement man&oelig;uvrables</p>\r\n<p>La poussi&egrave;re</p>\r\n<p>Les aliments que nous mangeons</p>\r\n<p>&nbsp;</p>\r\n<p>Tous ces points sont essentiels dans la fabrication des produits pour l&rsquo;Afrique dans le but d&rsquo;avoir un r&eacute;sultat efficace &agrave; 99,9%.&nbsp;</p>\r\n<p>Nous le faisons voil&agrave; pourquoi nous sommes les meilleurs.</p>\r\n<p>&nbsp;</p>\r\n<h2><strong>Que pouvons-nous vous apporter&nbsp;?</strong><strong>&nbsp;</strong></h2>\r\n<p>- &nbsp;<strong>Client</strong>&nbsp;(Celui qui utilise le produit)&nbsp;</p>\r\n<p>Nous vous garantissons une qualit&eacute; largement sup&eacute;rieure &agrave; ce que vous avez l&rsquo;habitude de voir sur votre march&eacute;. Sachez que les produits cachet&eacute;s GICOP sont marques de confiance.</p>\r\n<p>&nbsp;</p>\r\n<p>- <strong>&nbsp;Distributeur</strong> (Celui qui rach&egrave;te le produit fabriqu&eacute; pour le revendre)&nbsp;</p>\r\n<p>Notre offre pour vous est simple. Bon produit &agrave; bas prix ce qui vous garantit une marge sup&eacute;rieure &agrave; la moyenne.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>- &nbsp;<strong>Autres partenaires</strong>&nbsp;</p>\r\n<p>Nous sommes ouverts pour toutes sortes de n&eacute;gociations.</p>\r\n<p>&nbsp;</p>\r\n<p>Veuillez nous &eacute;crire au +225-22 00 67 00 ou info@gicop.ci</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'qui-sommes-nous', 0, '', '', 'Plan de travail 3 copie 3-100.jpg', 1, 244, 0, 1, '2017-07-25', '2017-07-25'),
(29, 'FAQ', '', '<h1>Questions fr&eacute;quentes</h1>\r\n<ul class=\"accordion\">\r\n<li><input checked=\"checked\" type=\"checkbox\" />\r\n<h2>O&ugrave; est situ&eacute; GICOP&nbsp;?</h2>\r\n<p class=\"p1\">Nous sommes situ&eacute;s au&nbsp;: &nbsp;<span class=\"apple-converted-space\">&nbsp;</span>2 Plateaux Vallons Rue des jardins non loin du supermarch&eacute; Top Budget<span class=\"apple-converted-space\">, Cocody, Abidjan, C&ocirc;te d&rsquo;Ivoire</span>.</p>\r\n</li>\r\n<li><input checked=\"checked\" type=\"checkbox\" />\r\n<h2>Qu&rsquo;en est-il de la livraison gratuite&nbsp;?</h2>\r\n<p class=\"p1\">GICOP livre partout en C&ocirc;te d&rsquo;Ivoire d&egrave;s que votre commande est sup&eacute;rieure ou &eacute;gale &agrave; 10mil Francs CFA. Pour les commandes &agrave; l&rsquo;ext&eacute;rieur du pays, les frais d&rsquo;exp&eacute;dition sont factur&eacute;s au client.&nbsp;</p>\r\n</li>\r\n<li><input checked=\"checked\" type=\"checkbox\" />\r\n<h2>Comment passer une commande avec GICOP ?</h2>\r\n<p>Envoyer un mail au service commercial&nbsp;: <a href=\"mailto:sales@gicop.ci\">sales@gicop.ci</a> o&ugrave; Appelez-le (+225)&nbsp;22 009 002</p>\r\n</li>\r\n<li><input checked=\"checked\" type=\"checkbox\" />\r\n<h2>Comment faire une r&eacute;clamation&nbsp;?</h2>\r\n<p>Aller sur la page&nbsp;:&nbsp;<a href=\"http://r&eacute;clamation.gicop.ci\">http://r&eacute;clamation.gicop.ci</a></p>\r\n</li>\r\n</ul>', 'faq', 0, '', '', 'Cover faccebook-15.jpg', 1, 100, 0, 1, '2017-07-26', '2017-07-26'),
(30, 'Site map fr', '', '<h1>Plan du site</h1>\r\n<ul class=\"site_map\">\r\n<li>\r\n<ul>\r\n<li>Nos services\r\n<ul>\r\n<li><a class=\"lien\" href=\"fr/expert-beaute\">Voir un expert</a> <a class=\"lien\" href=\"fr/boutique\">Notre boutique</a> <a class=\"lien\" href=\"fr/simulation\">Simulateur de beaut&eacute;</a> <a class=\"lien\" href=\"fr/jeux-et-promotions\">Jeux et promotions</a></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>S\'informer sur nous\r\n<ul>\r\n<li><a class=\"lien\" href=\"fr/qui-sommes-nous\">Qui sommes-nous?</a> <a class=\"lien\" href=\"fr/service-client\">Service client</a> <a class=\"lien\" href=\"fr/espace-presse\">Espace presse</a> <a class=\"lien\" href=\"fr/mentions-legales\">Mentions l&eacute;gales</a> <a class=\"lien\" href=\"fr/points-de-vente\">Nos points de ventes</a><a class=\"lien\" href=\"fr/temoignages\">Les t&eacute;moignages</a> <a class=\"lien\" href=\"fr/recrutement\">R&eacute;crutement</a></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>Aide\r\n<ul>\r\n<li><a class=\"lien\" href=\"fr/reclamations\">R&eacute;clamations</a> <a class=\"lien\" href=\"fr/conseils\">Conseils</a> <a class=\"lien\" href=\"fr/sitemap\">Plan du site</a> <a class=\"lien\" href=\"fr/faq\">FAQ</a></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>', 'site-map-fr', 0, '', '', '', 1, 46, 0, 1, '2017-09-14', '2017-09-14'),
(31, 'regles jeux', '', '<h2><span id=\"Valeur_des_conditions_g&eacute;n&eacute;rales_d&rsquo;utilisation\" class=\"mw-headline\">Valeur des conditions g&eacute;n&eacute;rales d&rsquo;utilisation</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a class=\"mw-editsection-visualeditor\" title=\"Modifier la section : Valeur des conditions g&eacute;n&eacute;rales d&rsquo;utilisation\" href=\"https://fr.wikipedia.org/w/index.php?title=Conditions_g%C3%A9n%C3%A9rales_d%27utilisation&amp;veaction=edit&amp;section=1\">modifier</a><span class=\"mw-editsection-divider\">&nbsp;|&nbsp;</span><a title=\"Modifier la section : Valeur des conditions g&eacute;n&eacute;rales d&rsquo;utilisation\" href=\"https://fr.wikipedia.org/w/index.php?title=Conditions_g%C3%A9n%C3%A9rales_d%27utilisation&amp;action=edit&amp;section=1\">modifier le code</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\r\n<p>Les conditions g&eacute;n&eacute;rales d&rsquo;utilisation ne sont pas un document obligatoire. Il s&rsquo;agit d&rsquo;un document optionnel qu&rsquo;il est possible de soumettre &agrave; l&rsquo;utilisateur d&rsquo;un service pour en encadrer l&rsquo;utilisation.</p>\r\n<p>Les conditions g&eacute;n&eacute;rales d&rsquo;utilisation sont un document&nbsp;<a class=\"mw-redirect\" title=\"Contractuel\" href=\"https://fr.wikipedia.org/wiki/Contractuel\">contractuel</a>. On parle de&nbsp;<a title=\"Contrat d\'adh&eacute;sion\" href=\"https://fr.wikipedia.org/wiki/Contrat_d%27adh%C3%A9sion\">contrat d&rsquo;adh&eacute;sion</a>&nbsp;par opposition au contrat n&eacute;goci&eacute;. L&rsquo;utilisateur du service choisit de les accepter ou de les refuser mais ne n&eacute;gocie pas leur contenu avec l&rsquo;exploitant du service.</p>\r\n<p>Comme tout document contractuel, les conditions g&eacute;n&eacute;rales d&rsquo;utilisation engagent l&rsquo;utilisateur du service et son exploitant &agrave; en respecter le contenu<span id=\"cite_ref-1\" class=\"reference\"><a href=\"https://fr.wikipedia.org/wiki/Conditions_g%C3%A9n%C3%A9rales_d%27utilisation#cite_note-1\">1</a></span>.</p>\r\n<h2><span id=\"Utilisation_sur_Internet\" class=\"mw-headline\">Utilisation sur Internet</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a class=\"mw-editsection-visualeditor\" title=\"Modifier la section : Utilisation sur Internet\" href=\"https://fr.wikipedia.org/w/index.php?title=Conditions_g%C3%A9n%C3%A9rales_d%27utilisation&amp;veaction=edit&amp;section=2\">modifier</a><span class=\"mw-editsection-divider\">&nbsp;|&nbsp;</span><a title=\"Modifier la section : Utilisation sur Internet\" href=\"https://fr.wikipedia.org/w/index.php?title=Conditions_g%C3%A9n%C3%A9rales_d%27utilisation&amp;action=edit&amp;section=2\">modifier le code</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\r\n<p>La majorit&eacute; des&nbsp;<a class=\"mw-redirect\" title=\"Sites Internet\" href=\"https://fr.wikipedia.org/wiki/Sites_Internet\">sites internet</a>&nbsp;disposent de conditions g&eacute;n&eacute;rales d&rsquo;utilisation. Leur contenu d&eacute;taillent le fonctionnement g&eacute;n&eacute;ral du site, les modalit&eacute;s de son utilisation et les r&egrave;gles &agrave; respecter pour ses utilisateurs.</p>\r\n<p>Elles se traduisent par une fen&ecirc;tre ou une page web d&eacute;di&eacute;e soumise &agrave; la lecture et &agrave; l\'appr&eacute;ciation de l\'utilisateur lors de son inscription ou de sa participation sur le site. Leur acceptation se fait le plus souvent par le biais d\'une case &agrave; cocher<span id=\"cite_ref-2\" class=\"reference\"><a href=\"https://fr.wikipedia.org/wiki/Conditions_g%C3%A9n%C3%A9rales_d%27utilisation#cite_note-2\">2</a></span>.</p>\r\n<h2><span id=\"Diff.C3.A9rences_avec_les_conditions_g.C3.A9n.C3.A9rales_de_vente\"></span><span id=\"Diff&eacute;rences_avec_les_conditions_g&eacute;n&eacute;rales_de_vente\" class=\"mw-headline\">Diff&eacute;rences avec les conditions g&eacute;n&eacute;rales de vente</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a class=\"mw-editsection-visualeditor\" title=\"Modifier la section : Diff&eacute;rences avec les conditions g&eacute;n&eacute;rales de vente\" href=\"https://fr.wikipedia.org/w/index.php?title=Conditions_g%C3%A9n%C3%A9rales_d%27utilisation&amp;veaction=edit&amp;section=3\">modifier</a><span class=\"mw-editsection-divider\">&nbsp;|&nbsp;</span><a title=\"Modifier la section : Diff&eacute;rences avec les conditions g&eacute;n&eacute;rales de vente\" href=\"https://fr.wikipedia.org/w/index.php?title=Conditions_g%C3%A9n%C3%A9rales_d%27utilisation&amp;action=edit&amp;section=3\">modifier le code</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\r\n<p>Les conditions g&eacute;n&eacute;rales d&rsquo;utilisation encadrent l&rsquo;utilisation d&rsquo;un service. Les&nbsp;<a title=\"Conditions g&eacute;n&eacute;rales de vente\" href=\"https://fr.wikipedia.org/wiki/Conditions_g%C3%A9n%C3%A9rales_de_vente\">conditions g&eacute;n&eacute;rales de vente</a>&nbsp;encadrent une relation commerciale.</p>\r\n<p>Sur internet, les conditions g&eacute;n&eacute;rales d&rsquo;utilisation peuvent &ecirc;tre utilis&eacute;es sur les&nbsp;<a class=\"mw-redirect\" title=\"Sites marchands\" href=\"https://fr.wikipedia.org/wiki/Sites_marchands\">sites marchands</a>&nbsp;comme sur les sites non marchands, leur objet &eacute;tant d&rsquo;encadrer l&rsquo;utilisation du site. Elles ne sont pas une obligation l&eacute;gale. En revanche, les conditions g&eacute;n&eacute;rales de vente ne trouvent d&rsquo;int&eacute;r&ecirc;t que sur les sites marchands, leur objet &eacute;tant d&rsquo;encadrer une relation commerciale. Elles constituent une obligation l&eacute;gale sur tous les sites marchands.</p>', 'regles-jeux', 0, '', '', 'Plan-de-travail-3-copie-2-100.jpg', 1, 0, 0, 1, '2018-01-15', '2018-01-15'),
(32, 'Jeux promo 1 an', '', '', 'jeux-promo-1-an', 0, '', '', '', 1, 0, 0, 1, '2018-06-04', '2018-06-04'),
(33, 'A propos de nous', '', '<h1>Blue Cleaners est un service de laverie et de pressing .</h1>\r\n<p>Aper&ccedil;u de nos services :</p>\r\n<ul>\r\n<li>Nettoyage de votre linge&nbsp;</li>\r\n<li>Repassage de haute qualit&eacute;</li>\r\n<li>Blanchisserie&nbsp;</li>\r\n<li>Pressing professionnel</li>\r\n<li>Nettoyage &agrave; sec premium</li>\r\n<li>Nettoyage de vos costumes d&eacute;licats</li>\r\n<li>Nettoyage de vos articles de literie (couettes, draps, oreillers...)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Nous vous proposons un service complet de laverie et de pressing. Blue Cleaners offre un service bon march&eacute;, simple et rapide : plus besoin de perdre votre temps &agrave; laver, d&eacute;tacher, repasser ou plier votre linge, gagnez du temps libre et profitez sereinement de votre vie.</p>\r\n<p>Ce n&rsquo;est pas toujours facile de trouver du temps pour soi, particuli&egrave;rement quand la lessive s&rsquo;accumule &agrave; la maison. Avec Blue Cleaners, le service de laverie et de pressing, vous r&eacute;cup&eacute;rez votre linge propre directement chez vous en l&rsquo;espace de quelques heures. Gr&acirc;ce &agrave; notre service mobile de livraison de linge, vous &eacute;conomisez le temps de trajet vers le pressing.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>Le service de laverie Blue Cleaners&ndash; Comment &ccedil;a marche?</h3>\r\n<p>Vous avez juste &agrave;&nbsp;nous signifier que vous avez de la lessive &agrave; faire, nous nous chargeons du reste ! Quand votre sac de linge est pr&ecirc;t,&nbsp;dites nous l&rsquo;endroit o&ugrave; l&rsquo;on doit venir chercher vos affaires et effectuer le retour. Notre chauffeur passera chercher votre linge chez vous au moment convenu. Notre service de collecte est id&eacute;al pour tous ceux qui sont trop occup&eacute;s ou qui pr&eacute;f&egrave;rent tout simplement profiter de la palpitante vie.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>O&ugrave; puis-je utiliser le service de laverie Blue Cleaners?</h3>\r\n<p>Blue Cleaners est disponible dans tout Conakry et sa proche banlieue. Si vous-vous demandez si nos chauffeurs se rendent jusqu\'&agrave; votre quartier, n\'h&eacute;sitez pas &agrave; jeter un coup d\'oeil &agrave; nous contacter.&nbsp;</p>\r\n<p>&nbsp;&nbsp;</p>\r\n<p>Vous vous posez encore des questions ? Alors contactez-nous ! Nous nous r&eacute;jouirons de tous vos commentaires, questions ou id&eacute;es. En effet, nous souhaitons toujours nous am&eacute;liorer et vous proposez exactement ce dont vous avez besoin. Vous pouvez nous &eacute;crire &agrave; cette adresse :&nbsp;info@BlueCleaners.com ou nous appeler au num&eacute;ro suivant : +224&nbsp;00 00 00 00 00!</p>', 'a-propos-de-nous', 0, '', '', '', 1, 91, 1, 1, '2018-07-30', '2018-07-30'),
(34, 'About us', '', '<h2><strong>Background and Rationale</strong></h2>\r\n<p>In September 2015, the 193 member states of the United Nations (UN) met at the headquarters of the International Organization in New York where they adopted a set of Sustainable Development Goals to eradicate poverty, protect the planet and to ensure prosperity for all as part of a new sustainable development agenda. There are 17 goals to be achieved across the world, including the \"Partnership for Development\" (Goal 17) of the 2030 Agenda for the SDGs, but paradoxically we find that in most Developing countries, this powerful media partner, is not sufficiently involved. And policy makers generally involve media when it comes to communicate about their positive results, but they do not give them keys to understand the issues related to SDGs so that they can criticize the action of governments, as well as NGOs whose potential is under-exploited.</p>\r\n<p>We have set up the Media For Change Platform which brings together journalists, bloggers and civil society actors. Sensitized and educated on Sustainable Development issues, their role will be crucial in promoting the SDGs; both through their productions (work) and their actions in their respective communities. The Media For Change Initiative aims on the one hand to train and support development actors so that they can, in turn, participate in better Communication for Development. And on the other hand, to raise a collective awareness that development is not a luxury, but on the contrary: a quest for shared dignity and a right for all. By virtue of that, working together to achieve change is also a collective duty.</p>\r\n<p>&nbsp;</p>\r\n<h2><strong>Means &amp; Operational Strategies</strong></h2>\r\n<p>The strategy of Media for Change is focused on the reinforcement of technical, material, organizational capacities of media professionals, bloggers, civil society leaders, and vulnerable segments of the society to operate a grassroots environmental awareness of the communities and freedom of expression through:</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Support to consolidate the management of development programs</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Participation in the national and international dialogs on policies and programs</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Generating, processing and sharing information for the benefit of the&nbsp;vulnerable segments;</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Holistic approach to development issues</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The training of human resources in all segments of the Sustainable human development</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Designing strategies to develop available human resources through integrative and environmentally friendly projects</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The organization of seminars and conferences, the carrying out of studies, surveys and consultations</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The promotion of clean and appropriate technologies</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The development of income-generating socio-economic activities</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The creation of demonstrative projects and training centers or farm schools</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The experimentation,&nbsp; research and extension</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The production and publishing of data on the living environment and issues relating to the well-being of both rural and urban populations</p>\r\n<p>Media for Change is strong of some 100 journalists, bloggers and civil society members, all engaged for the advancement of sustainable development through the promotion of good practices and the denunciation of bad ones. We are a dynamic network of volunteers from Africa, Europe, America and Asia, who have understood that \'\' Development is a need&rdquo; as stipulated in our motto.</p>', 'about-us', 0, '', '', '', 1, 15, 0, 1, '2018-07-30', '2018-07-30');
INSERT INTO `contenus` (`id`, `libelle_fr`, `intro_fr`, `description_fr`, `slug_fr`, `type_contenu`, `meta_title_fr`, `meta_desc_fr`, `image`, `ordre`, `nbr_vues`, `valid`, `statut`, `date_pub`, `date_enreg`) VALUES
(35, 'Conditions d\'utilisation', NULL, '<h3>D&Eacute;FINITIONS</h3>\r\n<p>Au sens des conditions g&eacute;n&eacute;rales d&rsquo;utilisation, les expressions ci-dessous auront la d&eacute;finition suivante :</p>\r\n<ul>\r\n<li>\r\n<p><strong>CGU</strong>&nbsp;d&eacute;signe les pr&eacute;sentes conditions g&eacute;n&eacute;rales d&rsquo;utilisation applicables aux Services.</p>\r\n</li>\r\n<li>\r\n<p><strong>Donn&eacute;es &agrave; Caract&egrave;re Personnel</strong>&nbsp;d&eacute;signe toute information concernant une personne physique identifi&eacute;e ou identifiable ; est r&eacute;put&eacute;e identifiable une personne qui peut &ecirc;tre identifi&eacute;e, directement ou indirectement, notamment par r&eacute;f&eacute;rence &agrave; un num&eacute;ro d&rsquo;identification ou &agrave; un ou plusieurs &eacute;l&eacute;ments sp&eacute;cifiques, propres &agrave; son identit&eacute; physique, physiologique, psychique, &eacute;conomique, culturelle ou sociale.</p>\r\n</li>\r\n<li>\r\n<p><strong>Donn&eacute;es de Sant&eacute; &agrave; Caract&egrave;re Personnel</strong>&nbsp;d&eacute;signe toute Donn&eacute;e &agrave; Caract&egrave;re Personnel de l&rsquo;Utilisateur recueillie par un Professionnel de Sant&eacute; &agrave; l&rsquo;occasion d&rsquo;activit&eacute;s de pr&eacute;vention, de diagnostic, de soins ou de suivi social et m&eacute;dico-social et notamment dans le cadre de l&rsquo;utilisation des Services.</p>\r\n</li>\r\n<li>\r\n<p><strong>Identifiant</strong>&nbsp;d&eacute;signe l&rsquo;identifiant personnel associ&eacute; au compte de l&rsquo;Utilisateur ainsi que tout code confidentiel ou mot de passe d&eacute;livr&eacute; &agrave; l&rsquo;Utilisateur par ALLFORSIGHT puis modifi&eacute; par l&rsquo;Utilisateur et permettant &agrave; l&rsquo;Utilisateur de s&rsquo;identifier afin d&rsquo;acc&eacute;der aux Services.</p>\r\n</li>\r\n<li>\r\n<p><strong>R&eacute;glementation sur les donn&eacute;es personnelles</strong>&nbsp;d&eacute;signe ensemble le r&egrave;glement (UE) 2016/679 du Parlement europ&eacute;en et du Conseil du 27 avril 2016 applicable &agrave; compter du 25 mai 2018 (ci-apr&egrave;s, &laquo; le R&egrave;glement G&eacute;n&eacute;ral sur la Protection des Donn&eacute;es &raquo;) et la loi &laquo; Informatique et libert&eacute;s &raquo; n&deg;78-17 du 6 janvier 1978 modifi&eacute;e la Loi n&deg; 78-17 du 6 Janvier 1978 relative &agrave; l&rsquo;informatique, aux fichiers et aux libert&eacute;s, et modifi&eacute;e par la loi n&deg; 2004-801 du 6 ao&ucirc;t 2004.</p>\r\n</li>\r\n<li>\r\n<p><strong>Parties</strong>&nbsp;d&eacute;signe conjointement ALLFORSIGHT et l&rsquo;Utilisateur.</p>\r\n</li>\r\n<li>\r\n<p><strong>Professionnel de sant&eacute;</strong>&nbsp;d&eacute;signe toute personne ayant souscrit une inscription aux Services propos&eacute;s par ALLFORSIGHT et relevant de la liste des professions de sant&eacute; telle qu&rsquo;&eacute;tablie par le Code de la sant&eacute; publique dans sa quatri&egrave;me partie &laquo; Professions de sant&eacute; &raquo;.</p>\r\n</li>\r\n<li>\r\n<p><strong>Services</strong>&nbsp;d&eacute;signe conjointement le Service d&rsquo;Annuaire et le Service de Prise de Rendez-Vous en Ligne mis &agrave; disposition des Utilisateurs par ALLFORSIGHT par le biais du Site.</p>\r\n</li>\r\n<li>\r\n<p><strong>Service d&rsquo;Annuaire</strong>&nbsp;d&eacute;signe le service gratuit de recherche de Professionnels de Sant&eacute; mis &agrave; disposition des Utilisateurs par ALLFORSIGHT par le biais du Site.</p>\r\n</li>\r\n<li>\r\n<p><strong>Service de Prise de Rendez-Vous en Ligne</strong>&nbsp;d&eacute;signe le Service de prise de rendez-vous en ligne aupr&egrave;s de Professionnels de Sant&eacute; mis &agrave; disposition des Utilisateurs par le biais du Site.</p>\r\n</li>\r\n<li>\r\n<p><strong>Site</strong>&nbsp;d&eacute;signe le site Internet www.ALLFORSIGHT.fr.</p>\r\n</li>\r\n<li>\r\n<p><strong>Utilisateur</strong>&nbsp;d&eacute;signe toute personne physique qui utilise le Site et acc&egrave;de aux Services propos&eacute;s par ALLFORSIGHT par le biais du Site.</p>\r\n</li>\r\n</ul>\r\n<p>Sauf indications contraires dans les CGU :</p>\r\n<ul>\r\n<li>\r\n<p>D&egrave;s lors qu&rsquo;un mot ou une phrase a un sens d&eacute;fini, toute autre forme de ce mot ou cette phrase a un sens correspondant ;</p>\r\n</li>\r\n<li>\r\n<p>Les mots au singulier incluent le pluriel et vice versa ;</p>\r\n</li>\r\n<li>\r\n<p>Une r&eacute;f&eacute;rence &agrave; un document, une norme, une disposition l&eacute;gislative, code ou tout autre document implique toute modification ou mise &agrave; jour de ce document, norme, disposition l&eacute;gislative ou code ;</p>\r\n</li>\r\n<li>\r\n<p>Si une p&eacute;riode de temps est sp&eacute;cifi&eacute;e et remonte &agrave; un jour donn&eacute; ou au jour d&rsquo;acceptation des CGU cette p&eacute;riode de temps doit &ecirc;tre calcul&eacute;e comme comprenant ce jour-l&agrave;.</p>\r\n</li>\r\n</ul>\r\n<h3>MENTIONS L&Eacute;GALES</h3>\r\n<p>Les Services de ALLFORSIGHT sont exploit&eacute;s par ALLFORSIGHT, SAS au capital de 132.258 euros, immatricul&eacute;e au RCS de PARIS sous le num&eacute;ro 794 598 813 dont le si&egrave;ge social est situ&eacute; au 32 rue de Monceau, 75008 PARIS et dont le num&eacute;ro de TVA intracommunautaire est FR14794598813.</p>\r\n<p>Directeur de la publication : Monsieur Stanislas NIOX-CHATEAU, Pr&eacute;sident.</p>\r\n<p>H&eacute;bergeur des Services : -&nbsp;<strong>AZNETWORK</strong>, SAS au capital de 345.215 Euros dont le si&egrave;ge social est situ&eacute; &agrave; ALENCON (61000), 40 rue Amp&egrave;re, immatricul&eacute;e sous le num&eacute;ro 423 880 061 R.C.S ALENCON -&nbsp;<strong>PICTIME GROUPE/COREYE</strong>, Soci&eacute;t&eacute; par Actions Simplifi&eacute;e au capital de 164.402 euros, immatricul&eacute;e au RCS de Lille sous le num&eacute;ro 443 498 571 et dont le si&egrave;ge social est situ&eacute; &agrave; 61 avenue de l&rsquo;harmonie, 59262 Sainghin-En-Melantois</p>\r\n<h3>OBJET DES CGU ET VERSION EN VIGUEUR</h3>\r\n<p>Les pr&eacute;sentes CGU ont pour objet de d&eacute;finir les conditions dans lesquelles les Utilisateurs peuvent acc&eacute;der aux Services et les utiliser.</p>\r\n<p>Tout Utilisateur qui acc&egrave;de aux Services propos&eacute;s par ALLFORSIGHT s\'engage &agrave; respecter, sans r&eacute;serve, les pr&eacute;sentes CGU, compl&eacute;t&eacute;es, le cas &eacute;ch&eacute;ant, des CPU. Ces CPU sont notifi&eacute;es avant l&rsquo;utilisation des Services aux Utilisateurs pour acceptation expresse et pr&eacute;alable.</p>\r\n<p>Si l&rsquo;Utilisateur n&rsquo;est pas en accord avec tout ou partie des CGU, il lui est vivement recommand&eacute; de ne pas utiliser le Site et les Services.</p>\r\n<p>ALLFORSIGHT est libre de modifier, &agrave; tout moment, les pr&eacute;sentes CGU, afin notamment de prendre en compte toute &eacute;volution l&eacute;gale, r&eacute;glementaire, jurisprudentielle et/ou technique. La version qui pr&eacute;vaut est celle qui est accessible en ligne &agrave; l&rsquo;adresse suivante : https://www.ALLFORSIGHT.fr/terms. Il en est de m&ecirc;me pour les &eacute;ventuelles CPU accessibles en ligne &agrave; l&rsquo;adresse des Services. Tout Utilisateur est donc tenu de se r&eacute;f&eacute;rer &agrave; leur version accessible en ligne &agrave; la date de son acc&egrave;s et de son utilisation des Services.</p>\r\n<p>L&rsquo;Utilisateur est express&eacute;ment inform&eacute; que l&rsquo;unique version des CGU des Services qui fait foi est celle qui se trouve en ligne sur le Site, ce qu&rsquo;il reconna&icirc;t et accepte sans restriction, s&rsquo;engageant &agrave; s&rsquo;y r&eacute;f&eacute;rer syst&eacute;matiquement lors de chaque connexion.</p>\r\n<h3>CAPACIT&Eacute;</h3>\r\n<p>L&rsquo;Utilisation des Services est r&eacute;serv&eacute;e aux Utilisateurs personnes physiques capables de souscrire des obligations conform&eacute;ment au droit fran&ccedil;ais.</p>\r\n<p>L&rsquo;Utilisateur peut utiliser les Services pour le compte de tiers sur lesquels il dispose de l&rsquo;autorit&eacute; parentale ou pour lesquels il est reconnu tuteur ou curateur conform&eacute;ment au droit fran&ccedil;ais.</p>\r\n<h3>INFORMATIONS, RESPONSABILIT&Eacute;S ET GARANTIES RELATIVES AUX MOYENS D\'ACC&Egrave;S AUX SERVICES</h3>\r\n<p>ALLFORSIGHT met en place les moyens n&eacute;cessaires &agrave; la bonne marche des Services. ALLFORSIGHT prend les mesures n&eacute;cessaires au maintien de la continuit&eacute; et de la qualit&eacute; des Services.</p>\r\n<p>L&rsquo;Utilisateur reconna&icirc;t que son utilisation des Services se fait &agrave; ses risques et p&eacute;rils. Les Services lui sont fournis &laquo; en l&rsquo;&eacute;tat &raquo; et sont accessibles sans aucune garantie de disponibilit&eacute; et de r&eacute;gularit&eacute;. ALLFORSIGHT s&rsquo;efforcera cependant de rendre les Services accessibles 24 heures sur 24, 7 jours sur 7, sauf en cas de force majeure ou d&rsquo;un &eacute;v&eacute;nement hors du contr&ocirc;le de ALLFORSIGHT et sous r&eacute;serve des p&eacute;riodes de maintenance, des pannes &eacute;ventuelles, des al&eacute;as techniques li&eacute;s &agrave; la nature du r&eacute;seau internet ou des actes de malveillance ou toute atteinte port&eacute;e au mat&eacute;riel ou aux logiciels de ALLFORSIGHT.</p>\r\n<p>ALLFORSIGHT ne peut &ecirc;tre tenue responsable des perturbations du r&eacute;seau Internet dues &agrave; des cas de force majeure au sens de la jurisprudence de la Cour de Cassation et du fait des op&eacute;rations de maintenance des Services planifi&eacute;es par ALLFORSIGHT. ALLFORSIGHT ne peut &eacute;galement pas &ecirc;tre tenue responsable de l&rsquo;installation et du fonctionnement des terminaux utilis&eacute;s par l&rsquo;Utilisateur pour acc&eacute;der aux Services et non fournis par ALLFORSIGHT.</p>\r\n<p>Plus g&eacute;n&eacute;ralement, ALLFORSIGHT ne pourra en aucun cas &ecirc;tre tenue pour responsable en raison d&rsquo;une interruption des Services quel que soit la cause, la dur&eacute;e ou la fr&eacute;quence de cette interruption.</p>\r\n<p>Les taux de transfert et les temps de r&eacute;ponse des informations circulant &agrave; partir de la plateforme de ALLFORSIGHT vers Internet ne sont pas garantis par ALLFORSIGHT.</p>\r\n<p>L&rsquo;Utilisateur reconna&icirc;t que la vitesse de transmission des informations ne d&eacute;pend pas des Services offerts par ALLFORSIGHT, mais des caract&eacute;ristiques inh&eacute;rentes aux r&eacute;seaux de communications &eacute;lectronique et des caract&eacute;ristiques techniques de son mode de connexion (c&acirc;ble, ADSL, 3G, 4G etc.) et de son acc&egrave;s internet.</p>\r\n<p>ALLFORSIGHT ne saurait en aucun cas &ecirc;tre tenue de r&eacute;parer d&rsquo;&eacute;ventuels dommages indirects subis par l&rsquo;Utilisateur &agrave; l&rsquo;occasion de l&rsquo;utilisation des Services. Les dommages indirects sont ceux qui ne r&eacute;sultent pas exclusivement et directement de la d&eacute;faillance des Services de ALLFORSIGHT.</p>\r\n<p>En outre, la responsabilit&eacute; de ALLFORSIGHT ne peut pas &ecirc;tre recherch&eacute;e pour des actes r&eacute;alis&eacute;s par l&rsquo;Utilisateur ou un tiers utilisant les Services.</p>\r\n<p>Tout logiciel, t&eacute;l&eacute;charg&eacute; par l&rsquo;Utilisateur, ou obtenu de toute autre mani&egrave;re lors de l&rsquo;utilisation du Service, l&rsquo;est aux risques et p&eacute;rils de l&rsquo;Utilisateur.</p>\r\n<h3>INFORMATIONS PR&Eacute;ALABLES RELATIVES AUX SERVICES</h3>\r\n<p>Le Site offre la possibilit&eacute; &agrave; l&rsquo;Utilisateur d&rsquo;utiliser : - Le Service d&rsquo;Annuaire ; - Le Service de Prise de Rendez-Vous en Ligne. et de recevoir des informations et documents de la part de ses praticiens.</p>\r\n<p>Les Services sont fournis &agrave; l&rsquo;Utilisateur &agrave; titre gratuit.</p>\r\n<p>N&eacute;anmoins, les &eacute;quipements (notamment ordinateur, t&eacute;l&eacute;phone, logiciels, moyens de communication &eacute;lectronique) permettant l&rsquo;acc&egrave;s et l&rsquo;utilisation des Services sont &agrave; la charge exclusive de l&rsquo;Utilisateur, de m&ecirc;me que les frais de communications &eacute;lectroniques (notamment co&ucirc;ts t&eacute;l&eacute;phoniques, co&ucirc;ts d&rsquo;acc&egrave;s &agrave; Internet) r&eacute;sultant de leur utilisation. Il appartient &agrave; l&rsquo;Utilisateur de s&rsquo;informer du prix d&rsquo;utilisation desdits &eacute;quipements ou services aupr&egrave;s des op&eacute;rateurs concern&eacute;s. L&rsquo;Utilisateur est seul redevable de leurs prix.</p>\r\n<p>Par ailleurs, l&rsquo;Utilisateur reconna&icirc;t que le Site renvoie &agrave; des prestations de services payantes. Notamment et par exemple, suite &agrave; une r&eacute;servation effectu&eacute;e par le biais du Service de Prise de Rendez-Vous en Ligne du Site, l&rsquo;Utilisateur reconna&icirc;t et accepte que la prestation de sant&eacute; effectu&eacute;e par le Professionnel de Sant&eacute; inscrit sur le Site soit payante. Lorsque ALLFORSIGHT fournit sur son Site des d&eacute;tails concernant les tarifs des honoraires d&rsquo;un Professionnel de Sant&eacute;, ces informations ne sont fournies qu&rsquo;&agrave; titre indicatif et par souci de commodit&eacute;. En aucun cas ALLFORSIGHT ne garantit l&rsquo;exactitude de telles informations.</p>\r\n<h3>SERVICE D&rsquo;ANNUAIRE</h3>\r\n<p>Le Service d&rsquo;Annuaire permet &agrave; l&rsquo;Utilisateur de rechercher un Professionnel de Sant&eacute; conform&eacute;ment &agrave; diff&eacute;rents crit&egrave;res (g&eacute;olocalisation, sp&eacute;cialit&eacute;, langues parl&eacute;es, homme/femme, etc.) et de consulter la page des Professionnels de Sant&eacute; ainsi recherch&eacute;s.</p>\r\n<p>ALLFORSIGHT ne garantit pas &agrave; l&rsquo;Utilisateur que son annuaire contienne l&rsquo;ensemble des professionnels de sant&eacute; exer&ccedil;ant sur le territoire fran&ccedil;ais et plus sp&eacute;cifiquement sur la zone g&eacute;ographique de recherche de l&rsquo;Utilisateur. En cons&eacute;quence, il est possible que l&rsquo;Utilisateur ne trouve pas un professionnel de sant&eacute; sur le Site en utilisant le Service d&rsquo;Annuaire.</p>\r\n<p>ALLFORSIGHT renvoie l&rsquo;Utilisateur au site des Ordres professionnels comp&eacute;tents s&rsquo;agissant des professionnels de sant&eacute; exer&ccedil;ant une profession r&eacute;glement&eacute;e et aux sites des syndicats repr&eacute;sentatifs des professionnels de sant&eacute; n&rsquo;exer&ccedil;ant pas une profession r&eacute;glement&eacute;e afin d&rsquo;obtenir la liste exhaustive de membres de chaque profession concern&eacute;e.</p>\r\n<p>ALLFORSIGHT rappelle &agrave; l&rsquo;Utilisateur qu&rsquo;en aucun cas le Service d&rsquo;Annuaire ne peut &ecirc;tre assimil&eacute;, du fait de son absence d&rsquo;exhaustivit&eacute;, &agrave; un service d&rsquo;adressage de patients aux Professionnels de Sant&eacute;.</p>\r\n<p>L&rsquo;Utilisateur conserve toujours le choix des professionnels de sant&eacute; qu&rsquo;ils consultent conform&eacute;ment aux dispositions applicables du Code de la sant&eacute; publique, aux dispositions d&eacute;ontologiques applicables aux professions r&eacute;glement&eacute;es et aux dispositions contraignantes applicables aux professions non r&eacute;glement&eacute;es.</p>\r\n<h3>SERVICE DE PRISE DE RENDEZ-VOUS EN LIGNE</h3>\r\n<p>L&rsquo;Utilisateur peut, &agrave; tout moment, prendre un rendez-vous en ligne avec un Professionnel de Sant&eacute; pour une consultation &agrave; un horaire indiqu&eacute; comme disponible par le Professionnel de Sant&eacute; sur le Portail et que l&rsquo;Utilisateur aura pr&eacute;alablement identifi&eacute; au sein du Portail par le biais du Service d&rsquo;Annuaire.</p>\r\n<p>Chaque rendez-vous est transmis en temps r&eacute;el au Professionnel de Sant&eacute;.</p>\r\n<p>L&rsquo;Utilisateur peut &eacute;galement g&eacute;rer ses rendez-vous (annulation, modification) et suivre l&rsquo;historique de ses rendez-vous.</p>\r\n<p>L&rsquo;Utilisateur autorise le Professionnel de Sant&eacute;, via ALLFORSIGHT, et/ou ALLFORSIGHT &agrave; lui envoyer des SMS et e-mails dont l&rsquo;objet est de lui d&eacute;livrer des informations au sujet des rendez-vous qu&rsquo;il a pris sur le Site.</p>\r\n<p>L&rsquo;Utilisateur autorise &eacute;galement le Professionnel de Sant&eacute;, via ALLFORSIGHT, et/ou ALLFORSIGHT &agrave; lui notifier par SMS ou e-mail toute information pratique concernant les Professionnels de Sant&eacute; qui font partie de la liste &laquo; Mon &eacute;quipe soignante &raquo; accessible sur le compte de chaque Utilisateur, ou toute information de sant&eacute; envoy&eacute;e par ces m&ecirc;mes Professionnels de Sant&eacute;. Tout Professionnel de Sant&eacute; chez qui l&rsquo;Utilisateur a pris rendez-vous est automatiquement ajout&eacute; &agrave; cette liste. L&rsquo;Utilisateur a la possibilit&eacute; de modifier sa liste directement depuis son compte.</p>\r\n<p>ALLFORSIGHT et le Professionnel de Sant&eacute; d&eacute;clinent toute responsabilit&eacute; en cas d&rsquo;erreur dans la saisie de ses coordonn&eacute;es par l&rsquo;Utilisateur rendant impossible l&rsquo;envoi de tout SMS ou de tout e-mail n&eacute;cessaire au bon fonctionnement et &agrave; la bonne administration du Service de Prise de Rendez-vous en Ligne.</p>\r\n<p>Il appartient &agrave; l&rsquo;Utilisateur de faire toutes v&eacute;rifications qui semblent n&eacute;cessaires ou opportunes avant de proc&eacute;der &agrave; une quelconque r&eacute;servation chez l&rsquo;un des Professionnels de Sant&eacute; inscrits sur le Site. ALLFORSIGHT n&rsquo;est aucunement responsable de l&rsquo;exactitude des informations qui figurent sur la page de chaque Professionnel de Sant&eacute;. L&rsquo;exactitude et la mise &agrave; jour de ces donn&eacute;es sont sous l&rsquo;enti&egrave;re responsabilit&eacute; du Professionnel de Sant&eacute;.</p>\r\n<p>L&rsquo;utilisation des Services ne dilue, ne modifie ou n&rsquo;att&eacute;nue ni directement, ni indirectement la responsabilit&eacute; et les obligations des Professionnels de Sant&eacute; inscrits aux Services vis-&agrave;-vis des Utilisateurs. Les Professionnels de Sant&eacute; exercent leur pratique professionnelle en toute ind&eacute;pendance, selon leurs obligations d&eacute;ontologiques, l&eacute;gales et r&eacute;glementaires personnelles et sous leur responsabilit&eacute; exclusive.</p>\r\n<p>ALLFORSIGHT n&rsquo;est en aucun cas responsable d&rsquo;une quelconque annulation ou indisponibilit&eacute; du Professionnel de Sant&eacute; cons&eacute;cutivement &agrave; l&rsquo;identification et &agrave; la programmation d&rsquo;un rendez-vous par l&rsquo;Utilisateur via le Service de Prise de Rendez-Vous en Ligne.</p>\r\n<p>L&rsquo;Utilisateur s&rsquo;engage &agrave; compl&eacute;ter toutes les Informations n&eacute;cessaires qui lui sont demand&eacute;es en vue de la bonne utilisation du Service de Prise de Rendez-Vous en Ligne.</p>\r\n<p>L&rsquo;Utilisateur est inform&eacute; du fait que la programmation d&rsquo;un rendez-vous via le Service de Prise de Rendez-Vous en Ligne constitue un engagement ferme de sa part, et que toute non pr&eacute;sentation &agrave; un rendez-vous programm&eacute; doit faire l&rsquo;objet d&rsquo;une information pr&eacute;alable d&rsquo;annulation ou de report aupr&egrave;s du Professionnel de Sant&eacute; concern&eacute;. Cette information peut s&rsquo;effectuer soit via le syst&egrave;me d&rsquo;annulation propos&eacute; via le Site, soit par tous moyens de contact du Professionnel de Sant&eacute; inscrit, au choix de l&rsquo;Utilisateur. L&rsquo;utilisateur reconna&icirc;t &ecirc;tre inform&eacute; qu&rsquo;il assume exclusivement les cons&eacute;quences de sa non-pr&eacute;sentation &agrave; un rendez-vous vis-&agrave;-vis du Professionnel de Sant&eacute; concern&eacute;. L&rsquo;Utilisateur est &eacute;galement inform&eacute; que s&rsquo;il est d&eacute;clar&eacute; absent par un m&ecirc;me Professionnel de Sant&eacute; &agrave; trois de ses rendez-vous, il ne lui sera plus possible de prendre rendez-vous en ligne jusqu&rsquo;&agrave; tant que le Professionnel de Sant&eacute; concern&eacute; ne d&eacute;bloque sa possibilit&eacute; de prise de rendez-vous.</p>\r\n<h3>INSCRIPTION ET ACC&Egrave;S AU SERVICE DE RENDEZ-VOUS EN LIGNE</h3>\r\n<p>Apr&egrave;s demande de cr&eacute;ation de son compte de l&rsquo;Utilisateur, ALLFORSIGHT d&eacute;livre &agrave; l&rsquo;Utilisateur des Identifiants afin que l&rsquo;Utilisateur puisse acc&eacute;der &agrave; son compte Utilisateur. Lors de sa demande d&rsquo;ouverture de son compte Utilisateur, l&rsquo;Utilisateur fournit des informations vraies, exactes, &agrave; jour et compl&egrave;tes sur son identit&eacute; comme demand&eacute;es dans le formulaire internet. Il s&rsquo;engage notamment &agrave; ne pas cr&eacute;er une fausse identit&eacute; de nature &agrave; induire ALLFORSIGHT ou les tiers en erreur et &agrave; ne pas usurper l&rsquo;identit&eacute; d&rsquo;une autre personne physique. L&rsquo;Utilisateur s&rsquo;engage &agrave; mettre imm&eacute;diatement &agrave; jour, en cas de modification, les donn&eacute;es qu&rsquo;il a communiqu&eacute;es initialement.</p>\r\n<p>Dans l&rsquo;hypoth&egrave;se o&ugrave; l&rsquo;Utilisateur fournirait des informations fausses, inexactes, p&eacute;rim&eacute;es, incompl&egrave;tes, trompeuses ou de nature &agrave; induire en erreur, ALLFORSIGHT pourra, imm&eacute;diatement sans pr&eacute;avis ni indemnit&eacute;, suspendre ou r&eacute;silier le compte Utilisateur de l&rsquo;Utilisateur et lui refuser l&rsquo;acc&egrave;s, de fa&ccedil;on temporaire ou d&eacute;finitive &agrave; tout ou partie des Services.</p>\r\n<p>Le compte Utilisateur comprend notamment ses Identifiants et plac&eacute;s sous la responsabilit&eacute; exclusive de l&rsquo;Utilisateur. L&rsquo;Utilisateur s&rsquo;oblige &agrave; les conserver secrets et &agrave; ne pas les divulguer sous quelque forme que ce soit. Si l&rsquo;un des &eacute;l&eacute;ments d&rsquo;identification de l&rsquo;Utilisateur est perdu ou vol&eacute;, ce dernier doit informer sans d&eacute;lai ALLFORSIGHT, qui proc&eacute;dera alors &agrave; l&rsquo;annulation et/ou la mise &agrave; jour imm&eacute;diate(s) de l&rsquo;Identifiant concern&eacute;.</p>\r\n<p>L&rsquo;Utilisateur est seul responsable de l&rsquo;utilisation qui est faite de ses Identifiants, m&ecirc;me si l&rsquo;Utilisateur pr&eacute;enregistre sur son ordinateur, son t&eacute;l&eacute;phone mobile ou sur n&rsquo;importe quel autre type d&rsquo;&eacute;quipement son Identifiant, permettant ainsi la connexion automatique aux Services.</p>\r\n<p>Tout acc&egrave;s, utilisation des Services et transmission de donn&eacute;es effectu&eacute;s &agrave; partir du compte Utilisateur d&rsquo;un Utilisateur sera r&eacute;put&eacute; avoir &eacute;t&eacute; effectu&eacute; par ce dernier. La sauvegarde de la confidentialit&eacute; des Identifiants de l&rsquo;Utilisateur rel&egrave;ve de l&rsquo;enti&egrave;re responsabilit&eacute; de ce dernier. A cet &eacute;gard, l&rsquo;Utilisateur est tenu de s&rsquo;assurer qu&rsquo;&agrave; l&rsquo;issue de chaque session il se d&eacute;connecte effectivement des Services, en particulier lorsqu&rsquo;il acc&egrave;de aux Services &agrave; partir d&rsquo;un ordinateur public.</p>\r\n<p>Toute perte, d&eacute;tournement ou utilisation non autoris&eacute;e des Identifiants d&rsquo;un Utilisateur et leurs cons&eacute;quences rel&egrave;vent de la seule responsabilit&eacute; de cet Utilisateur. Dans tous les cas mentionn&eacute;s ci-dessus, l&rsquo;Utilisateur est tenu d&rsquo;en avertir ALLFORSIGHT, sans d&eacute;lai, par message &eacute;lectronique, pr&eacute;cisant ses Identifiants, nom, pr&eacute;noms &agrave; l&rsquo;adresse suivante : julia@ALLFORSIGHT.fr, afin que ALLFORSIGHT puisse proc&eacute;der &agrave; la r&eacute;initialisation du compte Utilisateur.</p>\r\n<p>Chaque Utilisateur peut &agrave; tout moment r&eacute;silier la souscription de son compte Utilisateur en contactant ALLFORSIGHT par T&eacute;l&eacute;phone au : +33 1 83 355 358 ou par e-mail &agrave; : julia@ALLFORSIGHT.fr.</p>\r\n<h3>SITES TIERS</h3>\r\n<p>Pour le cas o&ugrave; les Services contiendraient des liens hypertextes renvoyant vers des sites internet &eacute;dit&eacute;s par des tiers (ci-apr&egrave;s les &laquo; Sites Tiers &raquo;) sur lesquels ALLFORSIGHT n\'exerce aucune sorte de contr&ocirc;le, ALLFORSIGHT n\'assume aucune responsabilit&eacute; quant au contenu des Sites Tiers ou au contenu vers lequel les Sites Tiers peuvent renvoyer. La pr&eacute;sence de liens hypertextes vers des Sites Tiers ne saurait signifier que ALLFORSIGHT approuve de quelque fa&ccedil;on que ce soit les contenus des Sites Tiers. ALLFORSIGHT n\'est responsable d\'aucune modification ou mise &agrave; jour concernant les Sites Tiers. ALLFORSIGHT n\'est pas responsable de la transmission d\'informations &agrave; partir des Sites Tiers, ni du mauvais fonctionnement de ceux-ci.</p>\r\n<h3>PROPRI&Eacute;T&Eacute; INTELLECTUELLE</h3>\r\n<p>Les Services de ALLFORSIGHT et tous les &eacute;l&eacute;ments qui les composent sont, sauf mentions particuli&egrave;res, la propri&eacute;t&eacute; exclusive de ALLFORSIGHT. Toutes les marques et tous les logos appartenant &agrave; ALLFORSIGHT ne peuvent pas &ecirc;tre utilis&eacute;s par l&rsquo;Utilisateur sans le consentement pr&eacute;alable &eacute;crit de ALLFORSIGHT.</p>\r\n<p>En cons&eacute;quence, en application des dispositions du Code de la propri&eacute;t&eacute; intellectuelle, des dispositions l&eacute;gislatives et r&eacute;glementaires de tous pays et des conventions internationales, toute reproduction, diffusion ou repr&eacute;sentation, int&eacute;grale ou partielle, des Services de ALLFORSIGHT ou d&rsquo;un quelconque &eacute;l&eacute;ment qui les compose est interdite de m&ecirc;me que leur alt&eacute;ration. A ce titre, il est notamment interdit &agrave; l&rsquo;Utilisateur d&rsquo;adapter, arranger, modifier, corriger, associer, traduire en toutes langues ou tous langages, mettre sur le march&eacute; &agrave; titre gratuit ou on&eacute;reux, commercialiser, tout ou partie des Services fournis par ALLFORSIGHT ou d&rsquo;un quelconque &eacute;l&eacute;ment qui les compose, quel qu&rsquo;en soient le moyen et le support. Aucune stipulation des CGU ne peut &ecirc;tre interpr&eacute;t&eacute;e comme une cession de droits de propri&eacute;t&eacute; intellectuelle que ce soit tacitement ou d&rsquo;une autre fa&ccedil;on.</p>\r\n<h3>PROTECTION DES DONN&Eacute;ES &Agrave; CARACT&Egrave;RE PERSONNEL</h3>\r\n<h4>DONN&Eacute;ES &Agrave; CARACT&Egrave;RE PERSONNEL RELATIVES &Agrave; L&rsquo;UTILISATEUR</h4>\r\n<p>ALLFORSIGHT invite express&eacute;ment l&rsquo;Utilisateur &agrave; consulter sa&nbsp;<a href=\"https://www.doctolib.fr/terms/agreement\">politique relative &agrave; la protection des donn&eacute;es personnelles</a>&nbsp;qui fait partie int&eacute;grante des pr&eacute;sentes CGU.</p>\r\n<h4>COOKIES ET ADRESSE IP</h4>\r\n<p>ALLFORSIGHT invite express&eacute;ment l&rsquo;Utilisateur &agrave; consulter sa&nbsp;<a href=\"https://www.doctolib.fr/terms/agreement\">politique relative &agrave; la protection des donn&eacute;es personnelles</a>&nbsp;qui fait partie int&eacute;grante des pr&eacute;sentes CGU afin de prendre connaissance de la politique de ALLFORSIGHT en mati&egrave;re de cookies.</p>\r\n<p>A la demande des autorit&eacute;s judiciaires, ALLFORSIGHT peut transmettre l&rsquo;adresse IP de l&rsquo;Utilisateur, afin que ce dernier soit identifi&eacute; en coop&eacute;ration avec son fournisseur d&rsquo;acc&egrave;s &agrave; Internet.</p>\r\n<h3>FORCE MAJEURE</h3>\r\n<p>Il y a force majeure lorsqu\'un &eacute;v&eacute;nement &eacute;chappant au contr&ocirc;le du d&eacute;biteur, qui ne pouvait &ecirc;tre raisonnablement pr&eacute;vu lors de l&rsquo;acceptation des CGU et dont les effets ne peuvent &ecirc;tre &eacute;vit&eacute;s par des mesures appropri&eacute;es, emp&ecirc;che l\'ex&eacute;cution de son obligation par le d&eacute;biteur</p>\r\n<p>Le cas de force majeure suspend les obligations de la partie concern&eacute;e pendant le temps o&ugrave; jouera la force majeure si cet &eacute;v&egrave;nement est temporaire. N&eacute;anmoins, les Parties s&rsquo;efforceront d&rsquo;en minimiser dans toute la mesure du possible les cons&eacute;quences.</p>\r\n<p>A d&eacute;faut, si l\'emp&ecirc;chement est d&eacute;finitif, les parties seront lib&eacute;r&eacute;es de leurs obligations dans les conditions pr&eacute;vues aux articles 1351 et 1351-1 du Code civil.</p>\r\n<h3>CONVENTION DE PREUVE</h3>\r\n<p>Les messages re&ccedil;us par t&eacute;l&eacute;copie ou par voie &eacute;lectronique et plus g&eacute;n&eacute;ralement les documents &eacute;lectroniques &eacute;chang&eacute;s entre ALLFORSIGHT et l&rsquo;Utilisateur sont des &eacute;crits d&rsquo;origine au sens de l&rsquo;article 1366du Code civil, c&rsquo;est &agrave; dire comme ayant la m&ecirc;me valeur que celle accord&eacute;e &agrave; l&rsquo;original. Il convient de conserver les t&eacute;l&eacute;copies ou les &eacute;crits &eacute;lectroniques de telle mani&egrave;re qu&rsquo;ils puissent constituer des copies fid&egrave;les et durables au sens de l&rsquo;article 1379 du Code civil.</p>\r\n<h3>RENONCIATION</h3>\r\n<p>Le fait pour l&rsquo;une ou l&rsquo;autre des Parties de ne pas se pr&eacute;valoir d&rsquo;une ou plusieurs stipulations des CGU ne pourra en aucun cas impliquer la renonciation par cette Partie &agrave; s&rsquo;en pr&eacute;valoir ult&eacute;rieurement.</p>\r\n<h3>NULLIT&Eacute; PARTIELLE</h3>\r\n<p>Dans le cas o&ugrave; certaines stipulations des CGU seraient inapplicables pour quelque raison que ce soit, y compris en raison d&rsquo;une loi ou d&rsquo;une r&eacute;glementation applicable, les parties resteront li&eacute;es par les autres stipulations des CGU et s&rsquo;efforceront de rem&eacute;dier aux clauses inapplicables dans le m&ecirc;me esprit que celui qui a pr&eacute;sid&eacute; lors de la conclusion.</p>\r\n<h3>DROIT APPLICABLE ET ATTRIBUTION DE COMP&Eacute;TENCE</h3>\r\n<p>Les CGU sont soumises &agrave; la loi fran&ccedil;aise. Toutes difficult&eacute;s relatives &agrave; la validit&eacute;, l&rsquo;application ou &agrave; l&rsquo;interpr&eacute;tation des CGU seront soumises, &agrave; d&eacute;faut d&rsquo;accord amiable, au Tribunal de Grande Instance de Paris, auquel les Parties attribuent comp&eacute;tence territoriale, quel que soit le lieu d&rsquo;ex&eacute;cution ou le domicile du d&eacute;fendeur. Cette attribution de comp&eacute;tence s&rsquo;applique &eacute;galement en cas de proc&eacute;dure en r&eacute;f&eacute;r&eacute;, de pluralit&eacute; de d&eacute;fendeurs ou d&rsquo;appel en garantie.</p>\r\n<h2>CONDITIONS PARTICULIERES D&rsquo;UTILISATION DU SERVICE DE CONSULTATION PAR VIDEO APPLICABLES &Agrave; COMPTER DU 19 NOVEMBRE 2018</h2>\r\n<p>Les pr&eacute;sentes Conditions Particuli&egrave;res d&rsquo;Utilisation (ci-apr&egrave;s &ldquo;CPU&rdquo;) s&rsquo;appliquent au Service de Consultation par Video (ou T&eacute;l&eacute;consultation) propos&eacute; par ALLFORSIGHT. Elles compl&egrave;tent les Conditions G&eacute;n&eacute;rales d&rsquo;Utilisation des Services ALLFORSIGHT. Si tel n&rsquo;&eacute;tait pas d&eacute;j&agrave; le cas, l&rsquo;acceptation des pr&eacute;sentes CPU emporte acceptation pleine et enti&egrave;re des Conditions G&eacute;n&eacute;rales d&rsquo;Utilisation aux Services ALLFORSIGHT.</p>\r\n<h3><a name=\"telehealth\"></a>D&Eacute;FINITIONS ADDITIONNELLES</h3>\r\n<p>Au sens des conditions particuli&egrave;res d&rsquo;utilisation, les expressions ci-dessous auront la d&eacute;finition suivante :</p>\r\n<ul>\r\n<li>\r\n<p><strong>Application Mobile</strong>&nbsp;d&eacute;signe l\'application ALLFORSIGHT disponible depuis un smartphone par suite du t&eacute;l&eacute;chargement de celle-ci sur un magasin d&rsquo;applications.</p>\r\n</li>\r\n<li>\r\n<p><strong>Site Mobile</strong>&nbsp;d&eacute;signe le site internet www.ALLFORSIGHT.fr accessible depuis un smartphone.</p>\r\n</li>\r\n<li>\r\n<p><strong>CPU</strong>&nbsp;d&eacute;signe les pr&eacute;sentes conditions particuli&egrave;res d&rsquo;utilisation applicables au Service de Consultation par Vid&eacute;o &eacute;galement nomm&eacute; &ldquo;Service de T&eacute;l&eacute;consultation&rdquo;.</p>\r\n</li>\r\n<li>\r\n<p><strong>Service(s) de T&eacute;l&eacute;consultation</strong>&nbsp;ou Service de Consultation par Vid&eacute;o d&eacute;signe la mise &agrave; disposition par ALLFORSIGHT &agrave; l&rsquo;Utilisateur d&rsquo;un outil permettant de r&eacute;aliser une consultation &agrave; distance par vid&eacute;otransmission avec un Professionnel de sant&eacute; au travers de l&rsquo;Application Mobile ou du Site Mobile.</p>\r\n</li>\r\n<li>\r\n<p><strong>T&eacute;l&eacute;consultation</strong>&nbsp;ou&nbsp;<strong>Consultation par Vid&eacute;o</strong>&nbsp;d&eacute;signe une consultation &agrave; distance entre un Utilisateur et un Professionnel de sant&eacute; r&eacute;alis&eacute;e par vid&eacute;otransmission via l&rsquo;Application Mobile ou le Site Mobile.</p>\r\n</li>\r\n</ul>\r\n<h3>OBJET DES CPU ET VERSION EN VIGUEUR</h3>\r\n<p>Les pr&eacute;sentes CPU ont pour objet de d&eacute;finir les conditions dans lesquelles les Utilisateurs peuvent acc&eacute;der au Service de T&eacute;l&eacute;consultation et l&rsquo;utiliser. Tout Utilisateur qui acc&egrave;de au Service de T&eacute;l&eacute;consultation propos&eacute; par ALLFORSIGHT s\'engage &agrave; respecter, sans r&eacute;serve, les pr&eacute;sentes CPU. Ces CPU sont notifi&eacute;es avant l&rsquo;utilisation du Service aux Utilisateurs pour acceptation expresse et pr&eacute;alable. Si l&rsquo;Utilisateur n&rsquo;est pas en accord avec tout ou partie des CPU, il ne doit pas utiliser le Service de T&eacute;l&eacute;consultation. ALLFORSIGHT est libre de modifier les CPU &agrave; tout moment, afin notamment de prendre en compte toute &eacute;volution l&eacute;gale, r&eacute;glementaire, jurisprudentielle et/ou technique. La version qui pr&eacute;vaut est celle qui est accessible en ligne au jour de l&rsquo;utilisation du Service de T&eacute;l&eacute;consultation. Tout Utilisateur est donc tenu de se r&eacute;f&eacute;rer &agrave; cette version &agrave; la date de son utilisation dudit service.</p>\r\n<h3>PROTECTION DES DONN&Eacute;ES &Agrave; CARACT&Egrave;RE PERSONNEL</h3>\r\n<p>ALLFORSIGHT ou tout autre tiers n&rsquo;ont pas acc&egrave;s &agrave; la T&eacute;l&eacute;consultation ou aux donn&eacute;es &eacute;chang&eacute;es entre l\'Utilisateur et les Professionnels de Sant&eacute;. Elles restent strictement confidentielles. ALLFORSIGHT invite express&eacute;ment l&rsquo;Utilisateur &agrave; consulter les dispositions sp&eacute;cifiques de sa&nbsp;<a href=\"https://www.doctolib.fr/terms/agreement\">politique relative &agrave; la protection des donn&eacute;es personnelles</a>, applicables &agrave; la T&eacute;l&eacute;consultation, qui fait partie int&eacute;grante des pr&eacute;sentes CPU.</p>\r\n<h3>INFORMATIONS RELATIVES AUX MOYENS D\'ACC&Egrave;S ET AU SERVICE</h3>\r\n<p>Afin d&rsquo;acc&eacute;der au Service de T&eacute;l&eacute;consultation et b&eacute;n&eacute;ficier d&rsquo;une T&eacute;l&eacute;consultation de qualit&eacute;, l&rsquo;Utilisateur doit disposer &agrave; minima,des &eacute;quipements suivants: (1) un smartphone suffisamment r&eacute;cent disposant d&rsquo;une cam&eacute;ra comportant une r&eacute;solution satisfaisante et (2) une connexion internet (en 4G) avec un d&eacute;bit suffisant. Si tel n&rsquo;est pas le cas, le Professionnel de Sant&eacute; pourra mettre un terme &agrave; la T&eacute;l&eacute;consultation et s&rsquo;il le juge opportun, pr&eacute;lever l&rsquo;Utilisateur de frais aff&eacute;rents aux actes d&eacute;j&agrave; effectu&eacute;s. ALLFORSIGHT n&rsquo;est qu&rsquo;un interm&eacute;diaire entre l&rsquo;Utilisateur et le Professionnel de sant&eacute;, leur permettant d&rsquo;effectuer une consultation &agrave; distance par vid&eacute;otransmission, l&rsquo;envoi de documents de mani&egrave;re &eacute;lectronique et le paiement en ligne.</p>\r\n<p>Le Service de T&eacute;l&eacute;consultation est fourni &agrave; l&rsquo;Utilisateur par ALLFORSIGHT &agrave; titre gratuit. Les &eacute;quipements (smartphone, connexion internet...) permettant l&rsquo;acc&egrave;s et l&rsquo;utilisation des Services de T&eacute;l&eacute;consultation sont &agrave; la charge exclusive de l&rsquo;Utilisateur, de m&ecirc;me que les frais de communications &eacute;lectroniques (notamment co&ucirc;ts t&eacute;l&eacute;phoniques, co&ucirc;ts d&rsquo;acc&egrave;s &agrave; Internet) y aff&eacute;rents. Il appartient &agrave; l&rsquo;Utilisateur de s&rsquo;informer du prix d&rsquo;utilisation desdits &eacute;quipements ou services aupr&egrave;s des op&eacute;rateurs concern&eacute;s avant d&rsquo;utiliser le Service de T&eacute;l&eacute;consultation.</p>\r\n<p>L&rsquo;Utilisateur reconna&icirc;t que le Service de T&eacute;l&eacute;consultation permet de b&eacute;n&eacute;ficier d&rsquo;une prestation de sant&eacute; payante et il en sera redevable au Professionnel de sant&eacute;.</p>\r\n<p>Les informations fournies par ALLFORSIGHT sur les tarifs ou honoraires pratiqu&eacute;s par un Professionnel de Sant&eacute; le sont &agrave; titre indicatif et par souci de commodit&eacute;. ALLFORSIGHT ne garantit pas l&rsquo;exactitude de telles informations. Le prix final de la T&eacute;l&eacute;consultation peut varier selon le type de consultation effectivement r&eacute;alis&eacute;. Il appartient au Professionnel de sant&eacute; d\'informer le patient du co&ucirc;t de cet acte.</p>\r\n<h3>CONDITIONS D\'ACC&Egrave;S ET D&rsquo;UTILISATION DU SERVICE DE T&Eacute;L&Eacute;CONSULTATION</h3>\r\n<p><strong>La T&eacute;l&eacute;consultation n\'est pas un service d\'urgence. En cas d&rsquo;urgence, l&rsquo;Utilisateur doit appeler le 15 ou le 112 ou se diriger vers un service d&rsquo;urgences.</strong></p>\r\n<p>Le service de T&eacute;l&eacute;consultation est accessible par l&rsquo;Utilisateur uniquement apr&egrave;s avoir pris rendez-vous en ligne sur le service de ALLFORSIGHT. La T&eacute;l&eacute;consultation se fait, pour le patient, exclusivement depuis un smartphone (via l&rsquo;Application Mobile ou le Site Mobile). Le smartphone doit &ecirc;tre &eacute;quip&eacute; d&rsquo;une cam&eacute;ra.</p>\r\n<p>L&rsquo;Utilisateur s&rsquo;engage &agrave; compl&eacute;ter toutes les informations n&eacute;cessaires qui lui sont demand&eacute;es et indispensables &agrave; la bonne utilisation du Service de T&eacute;l&eacute;consultation. Lors de la prise de rendez-vous pour une T&eacute;l&eacute;consultation, l&rsquo;Utilisateur doit notamment renseigner les informations bancaires qui seront n&eacute;cessaires au paiement de la T&eacute;l&eacute;consultation. Le syst&egrave;me de paiement est externalis&eacute; aupr&egrave;s d&rsquo;un prestataire de services de paiement agr&eacute;&eacute;.</p>\r\n<p>Lors du rendez-vous, l&rsquo;Utilisateur est invit&eacute; &agrave; se pr&eacute;senter &agrave; la T&eacute;l&eacute;consultation quelques minutes avant celle-ci afin de s&rsquo;assurer de la qualit&eacute; de la connexion de l&rsquo;audio et de la vid&eacute;o du smartphone.</p>\r\n<p>Lors de sa connexion en vue de la T&eacute;l&eacute;consultation, l&rsquo;Utilisateur est mis en attente par le Professionnel de sant&eacute; pour une dur&eacute;e laiss&eacute;e &agrave; l\'appr&eacute;ciation de ce dernier. Le Professionnel de sant&eacute; active ensuite le d&eacute;marrage de la T&eacute;l&eacute;consultation. ALLFORSIGHT ne saurait &ecirc;tre tenu responsable des retards ou annulation des Professionnels de sant&eacute;.</p>\r\n<p>L&rsquo;Utilisateur s&rsquo;engage &agrave; utiliser le Service de T&eacute;l&eacute;consultation dans des conditions lui permettant d&rsquo;assurer la confidentialit&eacute; et le bon d&eacute;roulement des &eacute;changes avec le Professionnel de Sant&eacute;. En particulier, l&rsquo;Utilisateur doit s&rsquo;assurer de r&eacute;aliser la T&eacute;l&eacute;consultation dans un endroit suffisamment lumineux et calme pour permettre une T&eacute;l&eacute;consultation de qualit&eacute;.</p>\r\n<p>Le Professionnel de sant&eacute; est seul juge de la pertinence d&rsquo;une prise en charge &agrave; distance de l&rsquo;Utilisateur et peut interrompre au besoin la T&eacute;l&eacute;consultation si les conditions d&rsquo;une prise en charge &agrave; distance ne sont pas r&eacute;unies. La dur&eacute;e d&rsquo;une T&eacute;l&eacute;consultation est laiss&eacute;e &agrave; la libre appr&eacute;ciation du Professionnel de Sant&eacute;. Lors de la T&eacute;l&eacute;consultation, l&rsquo;Utilisateur doit se conformer aux instructions pr&eacute;cis&eacute;es par le Professionnel de Sant&eacute;, pour une prise en charge optimale ou un diagnostic. Les Professionnels de Sant&eacute; r&eacute;alisent la T&eacute;l&eacute;consultation en toute ind&eacute;pendance, suivant les obligations d&eacute;ontologiques et l&eacute;gales qui leur incombent. La T&eacute;l&eacute;consultation se d&eacute;roule sous la responsabilit&eacute; exclusive de l&rsquo;Utilisateur et du Professionnel de Sant&eacute;.</p>\r\n<p>L\'Utilisateur s\'engage &agrave; ne pas enregistrer, copier ou diffuser tout contenu ou extrait de contenu en lien avec la T&eacute;l&eacute;consultation quel qu\'en soit le moyen, le support, le proc&eacute;d&eacute; ou la finalit&eacute;. La T&eacute;l&eacute;consultation n&rsquo;est enregistr&eacute;e ni par le Professionnel de Sant&eacute;, ni par ALLFORSIGHT ni par tout autre tiers. L\'Utilisateur est inform&eacute; que toute atteinte au droit &agrave; l&rsquo;image, au respect de la vie priv&eacute; ou au secret professionnel et m&eacute;dical peut faire l&rsquo;objet de sanctions, y compris p&eacute;nales.</p>\r\n<p>En cas de dysfonctionnement de quelque nature que ce soit lors de la T&eacute;l&eacute;consultation, l&rsquo;Utilisateur doit en informer imm&eacute;diatement le Professionnel de Sant&eacute;. L&rsquo;Utilisateur qui interrompt abusivement la T&eacute;l&eacute;consultation engage sa responsabilit&eacute; &agrave; l&rsquo;&eacute;gard du Professionnel de sant&eacute;.</p>\r\n<p>A l&rsquo;issue de la T&eacute;l&eacute;consultation, &agrave; laquelle le Professionnel de Sant&eacute; met fin, le Professionnel de sant&eacute; confirme le montant &agrave; payer par l&rsquo;Utilisateur. Selon la situation, le Professionnel de Sant&eacute; peut d&eacute;cider de revoir &agrave; la baisse ou de ne pas faire payer la T&eacute;l&eacute;consultation.</p>\r\n<p>L&rsquo;Utilisateur pourra ensuite recevoir dans son espace ALLFORSIGHT la note d&rsquo;honoraire correspondante, et le cas &eacute;ch&eacute;ant, le compte rendu de la t&eacute;l&eacute;consultation et/ou une prescription , en se rendant dans la Rubrique &ldquo;mes rendez-vous&rdquo; et en s&eacute;lectionnant la T&eacute;l&eacute;consultation r&eacute;alis&eacute;e afin de t&eacute;l&eacute;charger lesdits documents. L&rsquo;&eacute;tablissement d&rsquo;une prescription est &agrave; l&rsquo;appr&eacute;ciation du Professionnel de Sant&eacute;. La transmission par l\'Utilisateur de ces documents contenant des donn&eacute;es personnelles de sant&eacute; &agrave; tout tiers se fait sous sa seule responsabilit&eacute;.</p>\r\n<p>ALLFORSIGHT d&eacute;cline toute responsabilit&eacute; en cas de litige, quelle qu&rsquo;en soit la raison, entre l&rsquo;Utilisateur et un Professionnel de sant&eacute;, non directement imputable &agrave; ALLFORSIGHT.</p>\r\n<p>Les incivilit&eacute;s, verbales ou &eacute;crites, &agrave; l&rsquo;encontre des Professionnels de Sant&eacute; t&eacute;l&eacute;consultants peuvent faire l&rsquo;objet de poursuites et de la suppression du compte ALLFORSIGHT de l&rsquo;Utilisateur.</p>\r\n<p>L&rsquo;Utilisateur s&rsquo;engage &agrave; utiliser le service de T&eacute;l&eacute;consultation depuis le territoire Fran&ccedil;ais. ALLFORSIGHT ne peut s&rsquo;assurer de la conformit&eacute; de son produit et son utilisation au del&agrave; de la juridiction fran&ccedil;aise.</p>', 'conditions-d-utilisation', 0, '', '', NULL, 1, 2, 1, 1, '2019-01-28', '2019-01-28');
